(1,'肖家海',1,'中国','海子哥','XiaoJiaHai','肖家海，笔名海子哥，字孟德。江西吉安人，2022年首次以肖家海为笔名，发表中国现代史上第一篇Spring-Vue请后端分离系统《图书管理系统》，革命是痛苦，其中也必然混有污秽和血，决不是如诗人所想象的那般有趣，那般完美；革命尤其是现实的故事，需要各种卑贱的，麻烦的工作，决不如诗人想象的那般浪漫；革命当然有破坏，然而更需要建设，破坏是痛快的，但建设却是麻烦的事。所以对于革命抱着浪漫谛克的幻想的人，一和革命接近，一到革命进行，便容易失望。','个人实习生,文学创作者,计算机科学家,坤式篮球爱好者,国家饮食协会会长,区域语言文学奉献家,国粹继承人,社会主义接班人,艾溪湖街道办监管人员','0',1,'2022-02-14 20:53:38',1,'2022-02-25 10:42:06',1),
(4,'张三',1,'中国','法外狂徒','zangSan','123test','叛徒','0',1,'2022-02-15 14:38:20',1,'2022-02-16 22:55:30',1),
(5,'鲁迅',1,'中国','周树人','ZhouShuRen','    鲁迅（1881年9月25日～1936年10月19日），原名周樟寿，后改名周树人，字豫山，后改字豫才，浙江绍兴人。著名文学家、思想家、革命家、教育家 [179]  、民主战士，新文化运动的重要参与者，中国现代文学的奠基人之一。\n    早年与厉绥之和钱均夫同赴日本公费留学，于日本仙台医科专门学校肄业。 [183]  “鲁迅”，1918年发表《狂人日记》时所用的笔名，也是最为广泛的笔名。 [1-7] \n    鲁迅一生在文学创作、文学批评、思想研究、文学史研究、翻译、美术理论引进、基础科学介绍和古籍校勘与研究等多个领域具有重大贡献。他对于五四运动以后的中国社会思想文化发展具有重大影响，蜚声世界文坛，尤其在韩国、日本思想文化领域有极其重要的地位和影响，被誉为“二十世纪东亚文化地图上占最大领土的作家”。\n    毛泽东曾评价：“鲁迅的方向，就是中华民族新文化的方向。”','著名文学家,思想家,革命家,教育家,民主战士,新文化运动的重要参与者,中国现代文学的奠基人之一','0',1,'2022-02-16 13:58:15',1,'2022-02-16 22:55:41',1),
(6,'赛文·奥特曼',0,'日本','奥特曼','Ultraman','  奥特曼系列（日语：ウルトラマンシリーズ），是日本“特摄之神”的圆谷英二导演一手创办的“圆谷制作公司”（円谷プロダクション，原名：圆谷株式会社）自二十世纪六十年代起推出的空想特摄系列电视剧、电影、漫画、舞台剧等作品。\n  以1966年的《奥特Q》为首，自同年刚播出的《奥特曼》开始，建立了“巨大英雄与怪兽对战”的模式。中国台湾早期则有《飞天超空人》《大超人》《银河飞超人》《超人战士》等译名，后来受中国香港的影响也曾经一度用过《咸蛋超人》的译名。','宇宙保卫者,宇宙警备队大队长宇宙英雄,超人力霸王战士,咸蛋超人','0',1,'2022-02-16 15:45:27',1,'2022-02-28 17:31:38',1),
(7,'莫言',1,'中国','管谟业','MoYan','  莫言，本名管谟业，男，1955年2月17日生于山东省高密县河涯乡平安庄（现为高密市东北乡文化发展区大栏平安村），中国当代作家，中共党员。现为北京师范大学教授，国际写作中心主任，河北大学特聘教授。。2012年10月，成为首位中国籍诺贝尔文学奖获得者。\n  1966年，辍学回乡放牧牛羊。1973年8月，作为农民合同工到高密县第五棉油厂工作。1976年2月，参军，曾任战士、班长、教员、干事等职。1978年，开始进行文学创作。1981年，发表处女作短篇小说《春夜雨霏霏》，展露文学天赋。1984年9月，考入原解放军艺术学院文学系。1985年，发表成名作中篇小说《透明的红萝卜》。1986年，发表中篇小说《红高粱》，在文坛引起轰动。1987年，《红高粱》被张艺谋改编为同名电影，莫言担任编剧。1988年，《红高粱》获得西柏林国际电影节金熊奖；同年发表长篇小说《天堂蒜薹之歌》。1989年，出版长篇小说《食草家族》。   \n         - - - - - 来源：[百度词条]','中国当代作家,中共党员,北京师范大学教授,国际写作中心主任,河北大学特聘教授,中国籍诺贝尔文学奖获得者,香港大学荣誉文学博士','0',1,'2022-02-21 15:15:57',1,NULL,-1),
(8,'屠呦呦',2,'中国','屠呦呦','TuYouYou','  屠呦呦，女，1930年12月30日出生于浙江宁波，汉族，中共党员，药学家。1951年考入北京大学医学院药学系生药专业。1955年毕业于北京医学院（今北京大学医学部）。毕业后接受中医培训两年半，并一直在中国中医研究院（2005年更名为中国中医科学院）工作，期间晋升为硕士生导师、博士生导师。现为中国中医科学院首席科学家，终身研究员兼首席研究员 ，青蒿素研究开发中心主任，博士生导师，共和国勋章获得者。\n  多年从事中药和中西药结合研究，突出贡献是创制新型抗疟药青蒿素和双氢青蒿素。1972年成功提取分子式为C15H22O5的无色结晶体，命名为青蒿素。2011年9月，因发现青蒿素——一种用于治疗疟疾的药物，挽救了全球特别是发展中国家数百万人的生命获得拉斯克奖和葛兰素史克中国研发中心“生命科学杰出成就奖” [8]  。2015年10月获得诺贝尔生理学或医学奖，理由是她发现了青蒿素，该药品可以有效降低疟疾患者的死亡率。她成为首获科学类诺贝尔奖的中国人。\n  第一位获诺贝尔科学奖项的中国本土科学家。','中共党员,药学家,中国中医科学院首席科学家,终身研究员,首席研究员,青蒿素研究开发中心主任,博士生导师,共和国勋章获得者','0',1,'2022-02-21 15:23:23',1,NULL,-1),
(9,'三毛',2,'中国','陈平，陈懋平','Echo','  三毛（1943年3月26日—1991年1月4日），本名陈平，祖籍浙江舟山市定海区，出生于重庆市南岸区黄桷垭，中国台湾当代女作家、旅行家。\n  1967年，先后游学西班牙、德国、美国，并创作了散文集《雨季不再来》。1973年，定居西属撒哈拉沙漠，随后与荷西结婚。1976年2月，移居加那利群岛；5月，出版第一部散文集《撒哈拉的故事》，讲述夫妻二人在沙漠的生活经历。1977年到1979年，先后发表《哭泣的骆驼》《稻草人手记》《温柔的夜》等散文集。1980年，荷西意外逝世后回到台湾定居。1981年，出版散文集《梦里花落知多少》，表达对丈夫的思念之情。1982年，根据中南美洲旅行经历所创作的散文集《万水千山走遍》出版。1987年，出版散文集《我的宝贝》，展示她所收藏的一些物品。1990年，创作的第一部中文剧本，也是她的最后一部作品《滚滚红尘》出版 。1991年1月4日，在台湾荣民总医院逝世，终年四十七岁。','作家,旅行家','0',1,'2022-02-21 15:26:47',1,NULL,-1),
(10,'富兰克林·罗斯福',1,'美国','富兰克林·德拉诺·罗斯福','Franklin Delano Roosevelt','富兰克林·德拉诺·罗斯福（Franklin Delano Roosevelt）（1882年1月30日—1945年4月12日） 简称FDR，华人将其称为“小罗斯福”，美国第32任总统，美国历史上首位连任四届（病逝于第四届任期中）的总统。1911年，罗斯福进入纽约州参议院，直至1913年被威尔逊总统任命为助理海军部长，1920年去职。1929至1932年，任纽约州州长一职，并于1932年击败胡佛，当选为美国总统。在1930年代经济大萧条期间，罗斯福推行新政以提供失业救济与复苏经济，并成立众多机构来改革经济和银行体系，从经济危机的深渊中挽救了美国。1941年，偷袭珍珠港事件发生后，罗斯福力主对日本宣战，并引进了价格管制和配给。罗斯福以租借法案使美国转变为“民主国家的兵工厂”，使美国成为同盟国主要的军火供应商和融资者，也使得美国国内产业大幅扩张，实现充分就业。二战后期同盟国逐渐扭转形势后，罗斯福对塑造战后世界秩序发挥了关键作用，其影响力在雅尔塔会议及联合国的成立中尤其明显。1945年4月12日，罗斯福在佐治亚州的温泉因突发脑溢血去世,罗斯福是第二次世界大战期间反法西斯同盟阵营的重要领导人之一。','美国第32任总统,反法西斯同盟阵营的重要领导人,美国最佳总统,政治家,军事家,世界和平人物','0',1,'2022-02-21 15:33:07',1,NULL,-1),
(11,'海明威',1,'美国','欧内斯特·米勒尔·海明威','Ernest Miller Hemingway','  欧内斯特·米勒尔·海明威（Ernest Miller Hemingway，1899年7月21日－1961年7月2日），出生于美国伊利诺伊州芝加哥市郊区奥克帕克，美国作家、记者，被认为是20世纪最著名的小说家之一。\n  海明威的一生之中曾荣获不少奖项。他在第一次世界大战期间被授予银制勇敢勋章；1953年，他以《老人与海》一书获得普利策奖；1954年的《老人与海》又为海明威夺得诺贝尔文学奖。2001年，海明威的《太阳照样升起》（The Sun Also Rises）与《永别了，武器》两部作品被美国现代图书馆列入“20世纪中的100部最佳英文小说”中。\n  1961年7月2日，海明威在爱达荷州凯彻姆的家中用猎枪自杀身亡，享年61岁。\n  海明威一生中的感情错综复杂，先后结过四次婚，是美国“迷惘的一代”（Lost Generation）作家中的代表人物，作品中对人生、世界、社会都表现出了迷茫和彷徨。他一向以文坛硬汉著称，他是美利坚民族的精神丰碑。海明威的作品标志着他独特创作风格的形成，在美国文学史乃至世界文学史上都占有重要地位。','作家,记者,1954年诺贝尔文学奖获得者,“新闻体”小说的创始人','0',1,'2022-02-21 15:36:11',1,NULL,-1),
(12,'孔子',1,'中国','孔子、尼父、孔夫子，字仲尼','Confucius','  孔子（公元前551年9月28日-公元前479年4月11日），子姓，孔氏，名丘，字仲尼，鲁国陬邑（今山东省曲阜市）人，祖籍宋国栗邑（今河南省夏邑县），中国古代伟大的思想家、政治家、教育家，儒家学派创始人、“大成至圣先师”。\n  孔子开创私人讲学之风，倡导仁义礼智信。有弟子三千，其中贤人七十二。曾带领部分弟子周游列国十四年，晚年修订六经（《诗》《书》《礼》《乐》《易》《春秋》）。去世后，其弟子及再传弟子把孔子及其弟子的言行语录和思想记录下来，整理编成《论语》。该书被奉为儒家经典。\n  孔子是当时社会上最博学者之一，在世时就被尊奉为“天纵之圣”“天之木铎”，更被后世统治者尊为孔圣人、至圣、至圣先师、大成至圣文宣王先师、万世师表。其思想对中国和世界都有深远的影响，其人被列为“世界十大文化名人”之首。随着孔子影响力的扩大，祭祀孔子的“祭孔大典”一度成为和中国祖先神祭祀同等级别的大祀。','儒家学派创始人,中国古代伟大的思想家,政治家,教育家,儒家学派创始人,“大成至圣先师”','0',1,'2022-02-21 15:39:19',1,NULL,-1),
(13,'毛泽东',1,'中国','子任、石三伢子、二十八画生','Mao','  毛泽东（1893年12月26日-1976年9月9日），字润之（原作咏芝，后改润芝），笔名子任。湖南湘潭人。中国人民的领袖，伟大的马克思主义者，伟大的无产阶级革命家  、战略家、理论家，中国共产党、中国人民解放军和中华人民共和国的主要缔造者和领导人，马克思主义中国化的伟大开拓者，近代以来中国伟大的爱国者和民族英雄，中国共产党第一代中央领导集体的核心，领导中国人民彻底改变自己命运和国家面貌的一代伟人。\n  1949至1976年，毛泽东担任中华人民共和国最高领导人。他对马克思列宁主义的发展、军事理论的贡献以及对共产党的理论贡献被称为毛泽东思想。因毛泽东担任过的主要职务几乎全部称为主席，所以也被人们尊称为“毛主席”。\n  毛泽东被视为现代世界历史中最重要的人物之一，《时代》杂志也将他评为20世纪最具影响100人之一。','中国人民的领袖,伟大的马克思主义者,伟大的无产阶级革命家 ,战略家,理论家,中国共产党,中国人民解放军和中华人民共和国的主要缔造者和领导人,马克思主义中国化的伟大开拓者,近代以来中国伟大的爱国者和民族英雄,中国共产党第一代中央领导集体的核心','0',1,'2022-02-21 15:43:44',1,NULL,-1),
(14,'雨果',1,'法国','维克多·雨果，法兰西的莎士比亚','Victor Hugo','  维克多·雨果（ 英文名：Victor Hugo，1802年2月26日—1885年5月22日），法国19世纪前期积极浪漫主义文学的代表作家，人道主义的代表人物，法国文学史上卓越的资产阶级民主作家，被人们称为“法兰西的莎士比亚”。一生写过多部诗歌、小说、剧本、各种散文和文艺评论及政论文章，在法国及世界有着广泛的影响力。\n  1802年2月26日，雨果生于法国贝桑松，上有兄长二人。13岁时与兄长进入寄读学校就学，兄弟均成为学生领袖。他在16岁时已能创作杰出的诗句，21岁时出版诗集，声名大噪。1845年，法王路易·菲利普授予雨果上议院议员职位，自此专心从政。1848年法国二月革命爆发，法王路易被逊位。雨果于此时期四处奔走宣传革命，为人民贡献良多，赢得新共和政体的尊敬，晋封伯爵，并当选国民代表及国会议员。三年后，拿破仑三世称帝，他对此大加攻击，因此被放逐国外。此后20年间各处漂泊，此时期完成小说《悲惨世界》。1870年法国恢复共和政体（法兰西第三共和国），雨果结束流亡生涯，回到法国。1885年5月22日，雨果辞世，于潘德拉举行国葬。','浪漫主义文学的代表作家,人道主义的代表人物,资产阶级民主作家,革命家','0',1,'2022-02-21 15:49:43',1,NULL,-1),
(15,'刘慈欣',1,'中国','刘电工、大刘','Cixin Liu','刘慈欣，1963年6月出生于北京，祖籍河南省信阳市罗山，山西阳泉人，本科学历。1985年10月参加工作，作品蝉联1999年—2006年中国科幻小说银河奖，2010年赵树理文学奖，2011年《当代》年度长篇小说五佳第三名，2011年华语科幻星云奖最佳长篇小说奖，2010、2011年华语科幻星云奖最佳科幻作家奖，2012年人民文学柔石奖短篇小说金奖，2013年首届西湖类型文学奖金奖、第九届全国优秀儿童文学奖。代表作有长篇小说《超新星纪元》《球状闪电》《三体》三部曲等，中短篇小说《流浪地球》《乡村教师》《朝闻道》《不能共存的节日》《全频带阻塞干扰》等。其中《三体》三部曲被普遍认为是中国科幻文学的里程碑之作。2015年8月23日，凭借《三体》获第73届世界科幻大会颁发的雨果奖最佳长篇小说奖，为亚洲首次获奖。2017年6月25日，凭借《三体3：死神永生》获得轨迹奖最佳长篇科幻小说奖。2018年11月8日，获2018年克拉克想象力服务社会奖。2019年2月5日，刘慈欣作品改编电影《流浪地球》和《疯狂的外星人》上映，8月，获2019福布斯中国100名人榜荣誉。','高级工程师,科幻作家,中国作家协会会员,第九届、第十届全委会委员,中国科普作家协会会员,山西省作家协会副主席,阳泉市作家协会副主席,中国科幻小说代表作家','0',1,'2022-02-21 15:56:21',1,NULL,-1);
