(1,100,'123@qq.com','15770674965','江西省:九江市:共青城市:江益镇青年大道69号南昌航空大学科技学院','    南昌航空大学科技学院（Science and Technology College of NCHU）是一所面向全国招生、以工科为主、文理经管法专业相结合的普通高等院校。2001年7月经江西省教育厅、江西省计划发展委员会批准试办。\n    学院位于江西省赣江新区共青城市青年大道69号，地处昌九经济带中部、庐山南麓，鄱阳湖之滨，总建设投资4亿元，占地面积1000余亩，校舍建筑面积12万平方米，下设机械材料学部、信息电子学部、经济管理学部、艺术学部、文理学部等5个教学学部，设有25个本科专业。   \n                                                           - - - - - - 来源：[百度词条]','0',1,'2022-01-13 14:40:54',1,'2022-02-17 13:19:19',1),
(2,121,'nchk@nchk.com','19970246857','江西省:南昌市:新建区:学府大道凤凰路166号','  南昌航空大学图书馆成立于1978年，其前身是创建于1952年的南昌航空工业学院图书馆。现馆分前湖校区总馆（总馆图书馆大楼于2006年落成，面积为 40283.48m2 ，占地面积 7568m2 ）、上海路校区分馆和各学院18个专业分馆。\n  本馆现设有资源建设部、信息技术部、 流通部、阅览部和办公室；主要设有8个阅览室（ 自科、社科图书阅览室，自科期刊、社科期刊阅览室，教师研究生阅览室、文献检索室、捐赠书室、电子阅览室），1个总书库和1个文献特藏室；内设读者座位3100座。馆内主要场点布局为：一楼设有基本书库和电子阅览室；二楼设有教师研究生阅览室、 图书漂流岛、总服务台（含复印室）和休闲大厅；三楼设有自然科学图书阅览室、社会科学图书阅览室、资源建设部；四楼设有自然科学期刊阅览室（含报纸）、社会科学期刊阅览室、会议室和行政、党务办公室；五楼设有文献信息检索室、期刊加工室、捐赠书室、学生自习室、网络机房、情报业务室和多媒体室。六楼设有文献特藏室和日俄文书库。   - - - - - -来源：[百度词条]','0',1,'2022-02-17 11:41:33',1,'2022-02-17 13:11:55',1),
(4,123,'jxlibrary@yeah.net','88508952','江西省:南昌市:新建县:红谷滩区赣江北大道666号','江西省图书馆位于南昌市红谷滩新区凤凰洲，是江西省规模最大、藏书最多的综合性公共图书馆，是江西省文献资料、图书目录、馆际协作、图书馆学研究、信息交流和专业人才培训的中心。2018年被评定为国家一级公共图书馆 。\n江西省图书馆的前身是1920年成立的江西省公立图书馆；1927年更名为江西省立图书馆；1955年更名为江西省图书馆；1995年江西省图书馆从百花洲迁至洪都北大道 ；2015年于南昌市红谷滩新区凤凰洲选址新建江西省图书馆新馆舍；2019年元旦江西省图书馆洪都北大道馆闭馆；2020年1月1日江西省图书馆红谷滩新馆正式对外开放体验   。\n截至2020年1月，江西图书馆占地面积6.3万平方米 [3]  ，总建筑面积9.6万平方米，共有藏书310余万册，其中中文线装书50万余册。中文线装书中已整理的珍善本有2089种，地方文献3500余部，地方志1200部。该馆共有阅览座位6000余个，日最大接待读者量达到2万人次。 - - - - - - 来源：[百度词条]','0',1,'2022-02-17 11:55:03',1,'2022-02-17 13:11:12',1),
(5,124,'webmaster@nlc.gov.cn','88545426','北京市:北京市:海淀区:中关村南大街33号','  中国国家图书馆位于北京市中关村南大街33号，与海淀区白石桥高粱河、紫竹院公园相邻。是国家总书库，国家书目中心，国家古籍保护中心；是世界最大、最先进的国家图书馆之一 。入选第三批中国20世纪建筑遗产项目 。2018年10月11日，入选“全国中小学生研学实践教育基地”名单。 \n  中国国家图书馆前身是筹建于1909年9月9日的京师图书馆，1931年，文津街馆舍落成（现为国家图书馆古籍馆）；新中国成立后，更名为北京图书馆。1987年新馆落成，1998年12月12日经国务院批准，北京图书馆更名为国家图书馆，对外称中国国家图书馆。 \n  据2018年10月该图书馆官网信息显示，中国国家图书馆总建筑面积28万平方米，图书馆分为总馆南区、总馆北区和古籍馆，总馆南区主楼为双塔形高楼，采用双重檐形式，孔雀蓝琉璃瓦大屋顶，淡乳灰色的瓷砖外墙，花岗岩基座的石阶，再配以汉白玉栏杆，通体以蓝色为基调，取其用水慎火之意；馆藏文献3768.62万册，其中古籍文献近200万册，数字资源总量超过1000TB，是亚洲规模最大的图书馆，居世界国家图书馆第三位；图书馆共设有阅览室25个、阅览座位5000余个，在编员工1529人，设有33个机构部门。','0',1,'2022-02-17 12:08:19',1,'2022-02-17 13:10:10',1),
(6,125,'xinyunfuwu.com','64051155','北京市:北京市:东城区:交道口东大街85号','  北京市东城区第一图书馆（The First Library Of Beijing Dong Cheng District）位于北京市东城区交道口东大街85号，是北京市东城区政府兴办的综合性公共图书馆，是收集、整理文献，并向社会公众提供文献服务的公益性文化教育机构，是北京市精神文明先进单位 。\n  北京市东城区第一图书馆成立于1956年，原名“北京市东四区图书馆”；1959年，合并“北京市东单区图书馆”，成立“北京市东城区图书馆”；2013年更名为“北京市东城区第一图书馆”。\n  截至2011年5月，北京市东城区第一图书馆总面积11780平方米，馆内设有第一外借室、第二外借室、少儿借阅室、综合阅览室、外文阅览室、创意文献阅览室、地方文献阅览室、政府信息查阅室、自习室、视障阅览室10个服务窗口，拥有各类文献近60万册（件），阅览座位700席，可上网电脑100多台','0',1,'2022-02-17 12:22:05',1,'2022-02-17 13:09:27',1),
(7,126,'2749984520@qq.com','15770674965','江西省:南昌市:新建区:红谷滩新区学府大道999号','  南昌大学图书馆，于1993年5月南昌大学成立时，由原江西大学图书馆和原江西工业大学图书馆合并而成，是学校的文献信息中心，是为教学和科学研究服务的学术性机构，是学校信息化和社会信息化的重要基地。并成为中国高等教育文献保障系统 (CALIS) 成员馆、 CALIS 江西省高校文献信息服务中心、教育部科技查新工作站（ L25 ）、江西省医学科技情报中心。','0',1,'2022-02-17 12:47:48',1,'2022-02-17 13:21:33',1),
(8,127,'2749984520@qq.com','18779179697','江西省:南昌市:高新区:艾溪湖北俊彦路绿地玫瑰城112号','南昌高新区图书馆坐落于美丽的艾溪湖畔，馆内设有公共阅读区、儿童阅读区、文化交流区、影音活动区、艺术展览区、饮品休闲区及户外花园阅读区等，各功能区提供的特色服务使其成为集图书借阅、文化交流、社群公益、艺术展览为一体的复合型文化空间，馆内可同时容纳400名读者，节假日时可达到1000人的接待量，总藏书量达15万册。    - - - - -来源：[百度词条]','0',1,'2022-02-21 10:28:50',1,'2022-02-21 10:29:24',1),
(9,128,'PekingUniversityLy@pu.edu','19970246857','北京市:北京市:海淀区:颐和园路5号北京大学内(近中关村)','  北京大学图书馆（Peking University Library）成立于1898年，是中国最早的现代新型图书馆之一，被国务院批准为首批国家重点古籍保护单位，已发展成为资源丰富、现代化、综合性、开放式的研究型图书馆。\n  北京大学图书馆前身为建立于1898年的京师大学堂藏书楼，辛亥革命后，京师大学堂藏书楼改名为北京大学图书馆；1952年，北京大学图书馆合并了原燕京大学图书馆；2000年，北京大学与北京医科大学合并，原北京医科大学图书馆改称北京大学医学图书馆。\n  截至2015年底，北京大学图书馆由总馆、医学馆、38个分馆、储存馆组成，总面积约90000平米，其中，总馆面积约53000平米，阅览座位4000余个，2009年建成国内首例远程储存图书馆面积近5000平米；2014年，全馆人员（事业编制及合同制）学历构成：博士14人，硕士72人，本科66人，大专31人；总、分馆文献资源累积量约1100余万册（件），其中纸质藏书800余万册，以及大量引进和自建的国内外数字资源，包括各类数据库、电子期刊、电子图书和多媒体资源约300余万册（件）。\n                                                      - - - - -来源：[百度词条]','0',1,'2022-02-21 10:43:37',1,NULL,0),
(10,129,'TsinghuaUniversityLy@thu.edu','62785001','北京市:北京市:海淀区:双清路30号清华大学','  清华大学图书馆被国务院批准为首批国家重点古籍保护单位，目标是建成研究型、数字化和开放文明的现代化图书馆。 \n  1912年清华学堂改建为清华学校，正式建立了小规模的图书室，称清华学校图书室；1919年3月图书室独立馆舍（现老馆东部）落成，更名为清华学校图书馆；1928年，更名为国立清华大学图书馆；1949年，更名为清华大学图书馆。\n  截至2020年底，清华大学图书馆（含专业图书馆及院系资料室）的实体馆藏总量约548.46万册（件），形成了基本覆盖全学科、包含丰富文献类型和载体形式的综合性馆藏体系。图书馆系统由总馆及文科、美术、金融、法律、经管、建筑六个专业图书馆组成，馆舍总面积7万余平方米，阅览座位4000余席。           - - - - - 来源：[百度词条]','0',1,'2022-02-21 10:47:38',1,'2022-02-21 10:49:06',1),
(11,130,'zjdh@zjlib.cn','87988700','浙江省:杭州市:西湖区:曙光路73号','  浙江图书馆，位于浙江省杭州市，是中国国内创办最早的省级公共图书馆之一，是首批“全国古籍重点保护单位”，是原中华人民共和国文化部评定的“一级图书馆”、是全国文化信息资源共享工程浙江省分中心、全国图书馆联合编目中心浙江省分中心、长三角公共图书馆讲座联盟。\n  浙江图书馆创建于1900年，前身是杭州藏书楼，1909年浙江官书局并入，成立浙江图书馆；1951年接收藏书家刘承干捐赠的南浔嘉业堂藏书楼及藏书；1953年，确定使用“浙江图书馆”为馆名；2000年11月，浙江图书馆百年华诞之际，浙江图书馆新馆正式开馆。 \n  截至2016年，浙江图书馆建筑总面积4.7万平方米，在全省各地设有24个分馆、29个流通站，馆藏文献共673.44万册（件），其中，古籍线装书82.2万册，含善本15万册；报刊合订本90.77万册；馆藏雕版15万件；馆藏电子图书174.82万册。 图书馆有阅览座位1359席，全馆员工282人。','0',1,'2022-02-21 11:20:56',1,NULL,0),
(12,131,'web@library.hn.cn','0000000','湖南省:长沙市:芙蓉区:韶山北路168号','  湖南图书馆（Hunan Library）是国家举办的省级综合性公共图书馆，是中国国内第一家以“图书馆”命名的省级公共图书馆。\n  湖南图书馆建立于1904年3月，由梁焕奎等人募捐、湖南巡抚赵尔巽准令于古定王台创办的湖南图书馆兼教育博物馆。1912年，湖南图书馆改名“省立湖南图书馆” 。1984年7月，由湖南省编制委员会行文，同意湖南省图书馆改名为湖南图书馆。\n  据2017年2月图书馆官网显示，湖南图书馆馆舍主楼面积2.3万平方米，培训楼6700余平方米，馆藏实体文献450余万册（件），其中图书308余万册（件），古籍线装书80余万册（件），报刊55余万册（件），视听与缩微制品20余万件。电子图书达330万余种。设有阅览座位1570余个。\n                                                                       - - - - - - 来源：[百度词条]','0',1,'2022-02-21 11:30:37',1,NULL,0),
(13,132,'library@sh.cn','02164455555','上海市:上海市:徐汇区:淮海中路1555号','  上海图书馆（Shanghai Library）位于上海市徐汇区淮海中路，是上海市综合性研究型公共图书馆和行业情报中心，也是全国文化信息资源共享工程上海市分中心、文化部公共文化研究基地，是首批国家重点古籍保护单位。\n  上海图书馆创立于1952年，上海科学技术情报研究所成立于1958年，1995年上海图书馆与上海科学技术情报研究所合并，1996年12月上海图书馆新馆正式对外开放。 \n  截至2015年底，上海图书馆建筑面积12.7万平方米，拥有各类阅览室36个，设有24个机构部门，在编职工751人。图书馆藏有中外文献5600余万册（件），其中中文古籍线装书约170万余册，善本2.5万种17万册，属国家一、二级藏品2256种13526册。                 - - - - 来源：[百度百科]','0',1,'2022-02-21 11:37:31',1,'2022-02-21 11:42:08',1);
