(367,'作信息者',2,'com.nhXJH.web.controller.appllication.LibraryAuthController.edit()','PUT',1,'admin',NULL,'/userApplication/auth','127.0.0.1','内网IP','{\"country\":\"中国\",\"englishName\":\"XiaoJiaHai\",\"nickName\":\"海子哥\",\"sex\":1,\"updateTime\":1644850656928,\"synopsis\":\"肖家海，原名肖树人，字孟德。江西吉安人，2022年首次以肖家海为笔名，发表中国现代史上第一篇Spring-Vue请后端分离系统《图书管理系统》，革命是痛苦，其中也必然混有污秽和血，决不是如诗人所想象的那般有趣，那般完美；革命尤其是现实的故事，需要各种卑贱的，麻烦的工作，决不如诗人想象的那般浪漫；革命当然有破坏，然而更需要建设，破坏是痛快的，但建设却是麻烦的事。所以对于革命抱着浪漫谛克的幻想的人，一和革命接近，一到革命进行，便容易失望。\",\"params\":{},\"updatePersonal\":-1,\"createTime\":1644843218000,\"identity\":\"个人实习生\",\"name\":\"肖家海\",\"createPersonal\":1,\"id\":1,\"status\":\"1\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2022-02-14 22:57:37'),
