(491,'作信息者',1,'com.nhXJH.web.controller.appllication.LibraryAuthController.add()','POST',1,'admin',NULL,'/userApplication/auth','127.0.0.1','内网IP','{\"country\":\"中国\",\"englishName\":\"ZhouShuRen\",\"auth\":{\"country\":\"中国\",\"englishName\":\"ZhouShuRen\",\"nickName\":\"周树人\",\"sex\":1,\"synopsis\":\"    鲁迅（1881年9月25日～1936年10月19日），原名周樟寿，后改名周树人，字豫山，后改字豫才，浙江绍兴人。著名文学家、思想家、革命家、教育家 [179]  、民主战士，新文化运动的重要参与者，中国现代文学的奠基人之一。\\n    早年与厉绥之和钱均夫同赴日本公费留学，于日本仙台医科专门学校肄业。 [183]  “鲁迅”，1918年发表《狂人日记》时所用的笔名，也是最为广泛的笔名。 [1-7] \\n    鲁迅一生在文学创作、文学批评、思想研究、文学史研究、翻译、美术理论引进、基础科学介绍和古籍校勘与研究等多个领域具有重大贡献。他对于五四运动以后的中国社会思想文化发展具有重大影响，蜚声世界文坛，尤其在韩国、日本思想文化领域有极其重要的地位和影响，被誉为“二十世纪东亚文化地图上占最大领土的作家”。\\n    毛泽东曾评价：“鲁迅的方向，就是中华民族新文化的方向。”\",\"params\":{},\"createTime\":1644991014355,\"identity\":\"著名文学家,思想家,革命家,教育家,民主战士,新文化运动的重要参与者,中国现代文学的奠基人之一\",\"name\":\"鲁迅\",\"status\":\"0\"},\"nickName\":\"周树人\",\"sex\":1,\"synopsis\":\"    鲁迅（1881年9月25日～1936年10月19日），原名周樟寿，后改名周树人，字豫山，后改字豫才，浙江绍兴人。著名文学家、思想家、革命家、教育家 [179]  、民主战士，新文化运动的重要参与者，中国现代文学的奠基人之一。\\n    早年与厉绥之和钱均夫同赴日本公费留学，于日本仙台医科专门学校肄业。 [183]  “鲁迅”，1918年发表《狂人日记》时所用的笔名，也是最为广泛的笔名。 [1-7] \\n    鲁迅一生在文学创作、文学批评、思想研究、文学史研究、翻译、美术理论引进、基础科学介绍和古籍校勘与研究等多个领域具有重大贡献。他对于五四运动以后的中国社会思想文化发展具有重大影响，蜚声世界文坛，尤其在韩国、日本思想文化领域有极其重要的地位和影响，被誉为“二十世纪东亚文化地图上占最大领土的作家”。\\n    毛泽东曾评价：“鲁迅的方向，就是中华民族新文化的方向。”\",\"params\":{},\"createTime\":1644991014355,\"identity\":\"著名文学家,思想家,革命家,教育家,民主战士,新文化运动的重要参与者,中国现代文学的奠基人之一\",\"picList\":[{\"createPerson\":1,\"url\":\"/profile/avator/2022/02/16/b4372042-2fc2-4783-9b9a-e53af5a59f77.png\",\"groudId\":-5254210513578798000,\"newName\":\"2022/02/16/6722c6ee-dc43-40a4-aedb-8ec1c3a78b9c.png\",\"createTime\":1644991011904,\"name\":\"周树人.png\",\"id\":70,\"status\":0}],\"name\":\"鲁迅\",\"status\":\"0\"}',NULL,1,'\r\n### Error updating database.  Cause: com.mysql.cj.jdbc.exceptions.MysqlDataTruncation: Data truncation: Data too long for column \'synopsis\' at row 1\r\n### The error may exist in file [D:\\myFile\\javaEE\\graduateProject\\libraryMS\\nhXJH-admin\\target\\classes\\ma