(692,'分析字符串获取关键词',2,'com.nhXJH.web.controller.appllication.BaseFileController.analysisStr()','POST',1,'admin',NULL,'/userApplication/file/analysisStr','127.0.0.1','内网IP','{\"str\":\"    南昌航空大学科技学院（Science and Technology College of NCHU）是一所面向全国招生、以工科为主、文理经管法专业相结合的普通高等院校。2001年7月经江西省教育厅、江西省计划发展委员会批准试办。\\n    学院位于江西省赣江新区共青城市青年大道69号，地处昌九经济带中部、庐山南麓，鄱阳湖之滨，总建设投资4亿元，占地面积1000余亩，校舍建筑面积12万平方米，下设机械材料学部、信息电子学部、经济管理学部、艺术学部、文理学部等5个教学学部，设有25个本科专业。   \\n                                                           - - - - - - 来源：[百度词条]\"}','{\"msg\":\"操作成功\",\"code\":200,\"data\":[]}',0,NULL,'2022-02-18 14:16:54'),
(693,'分析字符串获取关键词',2,'com.nhXJH.web.controller.appllication.BaseFileController.analysisStr()','POST',1,'admin',NULL,'/userApplication/file/analysisStr','127.0.0.1','内网IP','{\"str\":\"  中国国家图书馆位于北京市中关村南大街33号，与海淀区白石桥高粱河、紫竹院公园相邻。是国家总书库，国家书目中心，国家古籍保护中心；是世界最大、最先进的国家图书馆之一 。入选第三批中国20世纪建筑遗产项目 。2018年10月11日，入选“全国中小学生研学实践教育基地”名单。 \\n  中国国家图书馆前身是筹建于1909年9月9日的京师图书馆，1931年，文津街馆舍落成（现为国家图书馆古籍馆）；新中国成立后，更名为北京图书馆。1987年新馆落成，1998年12月12日经国务院批准，北京图书馆更名为国家图书馆，对外称中国国家图书馆。 \\n  据2018年10月该图书馆官网信息显示，中国国家图书馆总建筑面积28万平方米，图书馆分为总馆南区、总馆北区和古籍馆，总馆南区主楼为双塔形高楼，采用双重檐形式，孔雀蓝琉璃瓦大屋顶，淡乳灰色的瓷砖外墙，花岗岩基座的石阶，再配以汉白玉栏杆，通体以蓝色为基调，取其用水慎火之意；馆藏文献3768.62万册，其中古籍文献近200万册，数字资源总量超过1000TB，是亚洲规模最大的图书馆，居世界国家图书馆第三位；图书馆共设有阅览室25个、阅览座位5000余个，在编员工1529人，设有33个机构部门。\"}','{\"msg\":\"操作成功\",\"code\":200,\"data\":[\"中国国家图书馆\",\"北京市\",\"中关村\",\"南大街\",\"海淀区\",\"白石桥\",\"高粱河\",\"紫竹院公园\",\"国家古籍保护中心\",\"中国\",\"中国国家图书馆\",\"京师图书馆\",\"文津街\",\"国家图书馆\",\"新中国\",\"北京图书馆\",\"国务院\",\"北京图书馆\",\"国家图书馆\",\"中国国家图书馆\",\"中国国家图书馆\",\"亚洲\"]}',0,NULL,'2022-02-18 14:17:08'),
(694,'分析字符串获取关键词',2,'com.nhXJH.web.controller.appllication.BaseFileController.analysisStr()','POST',1,'admin',NULL,'/userApplication/file/analysisStr','127.0.0.1','内网IP','{\"str\":\"    南昌航空大学科技学院（Science and Technology College of NCHU）是一所面向全国招生、以工科为主、文理经管法专业相结合的普通高等院校。2001年7月经江西省教育厅、江西省计划发展委员会批准试办。\\n    学院位于江西省赣江新区共青城市青年大道69号，地处昌九经济带中部、庐山南麓，鄱阳湖之滨，总建设投资4亿元，占地面积1000余亩，校舍建筑面积12万平方米，下设机械材料学部、信息电子学部、经济管理学部、艺术学部、文理学部等5个教学学部，设有25个本科专业。   \\n                                                           - - - - - - 来源：[百度词条]\"}','{\"msg\":\"操作成功\",\"code\":200,\"data\":[]}',0,NULL,'2022-02-18 14:17:14'),
(695,'分析字符串获取关键词',2,'com.nhXJH.web.controller.appllication.BaseFileController.analysisStr()','POST',1,'admin',NULL,'/userApplication/file/analysisStr','127.0.0.1','内网IP','{\"str\":\"  南昌航空大学图书馆成立于1978年，其前身是创建于1952年的南昌航空工业学院图书馆。现馆分前湖校区总馆（总馆图书馆大楼于2006年落成，面积为 40283.48m2 ，占地面积 7568m2 ）、上海路校区分馆和各学院18个专业分馆。\\n  本馆现设有资源建设部、信息技术部、 流通部、阅览部和办公室；主要设有8个阅览室（ 自科、社科图书阅览室，自科期刊、社科期刊阅览室，教师研究生阅览室、文献检索室、捐赠书室、电子阅览室），1个总书库和1个文献特藏室；内设读者座位3100座。馆内主要场点布局为：一楼设有基本书库和电子阅览室；二楼设有教师研究生阅览室、 图书漂流岛、总服务台（含复印室）和休闲大厅；三楼设有自然科学图书阅览室、社会科学图书阅览室、资源建设部；四楼设有自然科学期刊阅览室（含报纸）、社会科学期刊阅览室、会议室和行政、党务办公室；五楼设有文献信息检索室、期刊加工室、捐赠书室、学生自习室、网络机房、情报业务室和多媒体室。六楼设有文献特藏室和日俄文书库。   - - - - - -来源：[百度词条]\"}','{\"msg\":\"操作成功\",\"code\":200,\"data\":[]}',0,NULL,'2022-02-18 14:17:21'),
(696,'分析字符串获取关键词',2,'com.nhXJH.web.controller.appllication.BaseFileController.analysisStr()','POST',1,'admin',NULL,'/userApplication/file/analysisStr','127.0.0.1','内网IP','{\"str\":\"  北京市东城区第一图书馆（The First Library Of Beijing Dong Cheng District）位于北京市东城区交道口东大街85号，是北京市东城区政府兴办的综合性公共图书馆，是收集、整理文献，并向社会公众提供文献服务的公益性文化教育机构，是北京市精神文明先进单位 。\\n  北京市东城区第一图书馆成立于1956年，原名“北京市东四区图书馆”；1959年，合并“北京市东单区图书馆”，成立“北京市东城区图书馆”；2013年更名为“北京市东城区第一图书馆”。\\n  截至2011年5月，北京市东城区第一图书馆总面积11780平方米，馆内设有第一外借室、第二外借室、少儿借阅室、综合阅览室、外文阅览室、创意文献阅览室、地方文献阅览室、政府信息查阅室、自习室、视障阅览室10个服务窗口，拥有各类文献近60万册（件），阅览座位700席，可上网电脑100多台\"}','{\"msg\":\"操作成功\",\"code\":200,\"data\":[]}',0,NULL,'2022-02-18 14:17:28'),
