(725,'分析字符串获取关键词',2,'com.nhXJH.web.controller.appllication.BaseFileController.analysisStr()','POST',1,'admin',NULL,'/userApplication/file/analysisStr','127.0.0.1','内网IP','{\"str\":\"  北京市东城区第一图书馆（The First Library Of Beijing Dong Cheng District）位于北京市东城区交道口东大街85号，是北京市东城区政府兴办的综合性公共图书馆，是收集、整理文献，并向社会公众提供文献服务的公益性文化教育机构，是北京市精神文明先进单位 。\\n  北京市东城区第一图书馆成立于1956年，原名“北京市东四区图书馆”；1959年，合并“北京市东单区图书馆”，成立“北京市东城区图书馆”；2013年更名为“北京市东城区第一图书馆”。\\n  截至2011年5月，北京市东城区第一图书馆总面积11780平方米，馆内设有第一外借室、第二外借室、少儿借阅室、综合阅览室、外文阅览室、创意文献阅览室、地方文献阅览室、政府信息查阅室、自习室、视障阅览室10个服务窗口，拥有各类文献近60万册（件），阅览座位700席，可上网电脑100多台\"}','{\"msg\":\"操作成功\",\"code\":200,\"data\":[\"北京市东城区第一图书馆\",\"北京市\",\"东城区\",\"交道口\",\"东大街\",\"北京市东城区政府\",\"北京市\",\"北京市东城区第一图书馆\",\"北京市东四区图书馆\",\"北京市东单区图书馆\",\"北京市东城区图书馆\",\"北京市东城区第一图书馆\",\"北京市东城区第一图书馆\"]}',0,NULL,'2022-02-18 14:50:01'),
(726,'分析字符串获取关键词',2,'com.nhXJH.web.controller.appllication.BaseFileController.analysisStr()','POST',1,'admin',NULL,'/userApplication/file/analysisStr','127.0.0.1','内网IP','{\"str\":\"  南昌航空大学图书馆成立于1978年，其前身是创建于1952年的南昌航空工业学院图书馆。现馆分前湖校区总馆（总馆图书馆大楼于2006年落成，面积为 40283.48m2 ，占地面积 7568m2 ）、上海路校区分馆和各学院18个专业分馆。\\n  本馆现设有资源建设部、信息技术部、 流通部、阅览部和办公室；主要设有8个阅览室（ 自科、社科图书阅览室，自科期刊、社科期刊阅览室，教师研究生阅览室、文献检索室、捐赠书室、电子阅览室），1个总书库和1个文献特藏室；内设读者座位3100座。馆内主要场点布局为：一楼设有基本书库和电子阅览室；二楼设有教师研究生阅览室、 图书漂流岛、总服务台（含复印室）和休闲大厅；三楼设有自然科学图书阅览室、社会科学图书阅览室、资源建设部；四楼设有自然科学期刊阅览室（含报纸）、社会科学期刊阅览室、会议室和行政、党务办公室；五楼设有文献信息检索室、期刊加工室、捐赠书室、学生自习室、网络机房、情报业务室和多媒体室。六楼设有文献特藏室和日俄文书库。   - - - - - -来源：[百度词条]\"}','{\"msg\":\"操作成功\",\"code\":200,\"data\":[\"南昌航空大学图书馆\",\"南昌航空工业学院图书馆\",\"前湖\",\"上海路校区分馆\",\"资源建设部\",\"百度\"]}',0,NULL,'2022-02-18 14:55:24'),
(727,'分析字符串获取关键词',2,'com.nhXJH.web.controller.appllication.BaseFileController.analysisStr()','POST',1,'admin',NULL,'/userApplication/file/analysisStr','127.0.0.1','内网IP','{\"str\":\"江西省图书馆位于南昌市红谷滩新区凤凰洲，是江西省规模最大、藏书最多的综合性公共图书馆，是江西省文献资料、图书目录、馆际协作、图书馆学研究、信息交流和专业人才培训的中心。2018年被评定为国家一级公共图书馆 。\\n江西省图书馆的前身是1920年成立的江西省公立图书馆；1927年更名为江西省立图书馆；1955年更名为江西省图书馆；1995年江西省图书馆从百花洲迁至洪都北大道 ；2015年于南昌市红谷滩新区凤凰洲选址新建江西省图书馆新馆舍；2019年元旦江西省图书馆洪都北大道馆闭馆；2020年1月1日江西省图书馆红谷滩新馆正式对外开放体验   。\\n截至2020年1月，江西图书馆占地面积6.3万平方米 [3]  ，总建筑面积9.6万平方米，共有藏书310余万册，其中中文线装书50万余册。中文线装书中已整理的珍善本有2089种，地方文献3500余部，地方志1200部。该馆共有阅览座位6000余个，日最大接待读者量达到2万人次。 - - - - - - 来源：[百度词条]\"}','{\"msg\":\"操作成功\",\"code\":200,\"data\":[\"江西省图书馆\",\"南昌市\",\"红谷滩\",\"凤凰洲\",\"江西省\",\"江西省\",\"江西省图书馆\",\"江西省\",\"江西省立图书馆\",\"江西省图书馆\",\"江西省图书馆\",\"百花洲\",\"洪都\",\"北大道\",\"南昌市\",\"红谷滩\",\"凤凰洲\",\"江西省图书馆\",\"江西省图书馆\",\"洪都\",\"大道\",\"江西省图书馆\",\"红谷滩\",\"江西图书馆\"]}',0,NULL,'2022-02-18 14:55:53'),
