(859,'分析字符串获取关键词',2,'com.nhXJH.web.controller.appllication.BaseFileController.analysisStr()','POST',1,'admin',NULL,'/userApplication/file/analysisStr','127.0.0.1','内网IP','{\"str\":\"江西省图书馆位于南昌市红谷滩新区凤凰洲，是江西省规模最大、藏书最多的综合性公共图书馆，是江西省文献资料、图书目录、馆际协作、图书馆学研究、信息交流和专业人才培训的中心。2018年被评定为国家一级公共图书馆 。\\n江西省图书馆的前身是1920年成立的江西省公立图书馆；1927年更名为江西省立图书馆；1955年更名为江西省图书馆；1995年江西省图书馆从百花洲迁至洪都北大道 ；2015年于南昌市红谷滩新区凤凰洲选址新建江西省图书馆新馆舍；2019年元旦江西省图书馆洪都北大道馆闭馆；2020年1月1日江西省图书馆红谷滩新馆正式对外开放体验   。\\n截至2020年1月，江西图书馆占地面积6.3万平方米 [3]  ，总建筑面积9.6万平方米，共有藏书310余万册，其中中文线装书50万余册。中文线装书中已整理的珍善本有2089种，地方文献3500余部，地方志1200部。该馆共有阅览座位6000余个，日最大接待读者量达到2万人次。 - - - - - - 来源：[百度词条]\"}','{\"msg\":\"操作成功\",\"code\":200,\"data\":[]}',0,NULL,'2022-02-18 15:35:52'),
(860,'查询附件实体对应信息列表',0,'com.nhXJH.web.controller.appllication.LibraryMechanismController.getFile()','GET',1,'admin',NULL,'/userApplication/mechanism/getFile/5','127.0.0.1','内网IP','{id=5}','{\"msg\":\"操作成功\",\"code\":200,\"data\":[\"/dev-api/profile/avatar/2022/system/no-picture.png\"]}',0,NULL,'2022-02-18 15:35:53'),
(861,'分析字符串获取关键词',2,'com.nhXJH.web.controller.appllication.BaseFileController.analysisStr()','POST',1,'admin',NULL,'/userApplication/file/analysisStr','127.0.0.1','内网IP','{\"str\":\"  中国国家图书馆位于北京市中关村南大街33号，与海淀区白石桥高粱河、紫竹院公园相邻。是国家总书库，国家书目中心，国家古籍保护中心；是世界最大、最先进的国家图书馆之一 。入选第三批中国20世纪建筑遗产项目 。2018年10月11日，入选“全国中小学生研学实践教育基地”名单。 \\n  中国国家图书馆前身是筹建于1909年9月9日的京师图书馆，1931年，文津街馆舍落成（现为国家图书馆古籍馆）；新中国成立后，更名为北京图书馆。1987年新馆落成，1998年12月12日经国务院批准，北京图书馆更名为国家图书馆，对外称中国国家图书馆。 \\n  据2018年10月该图书馆官网信息显示，中国国家图书馆总建筑面积28万平方米，图书馆分为总馆南区、总馆北区和古籍馆，总馆南区主楼为双塔形高楼，采用双重檐形式，孔雀蓝琉璃瓦大屋顶，淡乳灰色的瓷砖外墙，花岗岩基座的石阶，再配以汉白玉栏杆，通体以蓝色为基调，取其用水慎火之意；馆藏文献3768.62万册，其中古籍文献近200万册，数字资源总量超过1000TB，是亚洲规模最大的图书馆，居世界国家图书馆第三位；图书馆共设有阅览室25个、阅览座位5000余个，在编员工1529人，设有33个机构部门。\"}','{\"msg\":\"操作成功\",\"code\":200,\"data\":[]}',0,NULL,'2022-02-18 15:35:54'),
