(931,'分析字符串获取关键词',2,'com.nhXJH.web.controller.appllication.BaseFileController.analysisStr()','POST',1,'admin',NULL,'/userApplication/file/analysisStr','127.0.0.1','内网IP','{\"str\":\"江西省图书馆位于南昌市红谷滩新区凤凰洲，是江西省规模最大、藏书最多的综合性公共图书馆，是江西省文献资料、图书目录、馆际协作、图书馆学研究、信息交流和专业人才培训的中心。2018年被评定为国家一级公共图书馆 。\\n江西省图书馆的前身是1920年成立的江西省公立图书馆；1927年更名为江西省立图书馆；1955年更名为江西省图书馆；1995年江西省图书馆从百花洲迁至洪都北大道 ；2015年于南昌市红谷滩新区凤凰洲选址新建江西省图书馆新馆舍；2019年元旦江西省图书馆洪都北大道馆闭馆；2020年1月1日江西省图书馆红谷滩新馆正式对外开放体验   。\\n截至2020年1月，江西图书馆占地面积6.3万平方米 [3]  ，总建筑面积9.6万平方米，共有藏书310余万册，其中中文线装书50万余册。中文线装书中已整理的珍善本有2089种，地方文献3500余部，地方志1200部。该馆共有阅览座位6000余个，日最大接待读者量达到2万人次。 - - - - - - 来源：[百度词条]\"}','{\"msg\":\"操作成功\",\"code\":200,\"data\":[]}',0,NULL,'2022-02-18 16:44:02'),
