(993,'分析字符串获取关键词',2,'com.nhXJH.web.controller.appllication.BaseFileController.analysisStr()','POST',1,'admin',NULL,'/userApplication/file/analysisStr','127.0.0.1','内网IP','{\"str\":\"  北京市东城区第一图书馆（The First Library Of Beijing Dong Cheng District）位于北京市东城区交道口东大街85号，是北京市东城区政府兴办的综合性公共图书馆，是收集、整理文献，并向社会公众提供文献服务的公益性文化教育机构，是北京市精神文明先进单位 。\\n  北京市东城区第一图书馆成立于1956年，原名“北京市东四区图书馆”；1959年，合并“北京市东单区图书馆”，成立“北京市东城区图书馆”；2013年更名为“北京市东城区第一图书馆”。\\n  截至2011年5月，北京市东城区第一图书馆总面积11780平方米，馆内设有第一外借室、第二外借室、少儿借阅室、综合阅览室、外文阅览室、创意文献阅览室、地方文献阅览室、政府信息查阅室、自习室、视障阅览室10个服务窗口，拥有各类文献近60万册（件），阅览座位700席，可上网电脑100多台\"}','{\"msg\":\"操作成功\",\"code\":200,\"data\":[]}',0,NULL,'2022-02-18 16:56:42'),
