(1064,'分析字符串获取关键词',2,'com.nhXJH.web.controller.appllication.BaseFileController.analysisStr()','POST',1,'admin',NULL,'/userApplication/file/analysisStr','127.0.0.1','内网IP','{\"str\":\"    南昌航空大学科技学院（Science and Technology College of NCHU）是一所面向全国招生、以工科为主、文理经管法专业相结合的普通高等院校。2001年7月经江西省教育厅、江西省计划发展委员会批准试办。\\n    学院位于江西省赣江新区共青城市青年大道69号，地处昌九经济带中部、庐山南麓，鄱阳湖之滨，总建设投资4亿元，占地面积1000余亩，校舍建筑面积12万平方米，下设机械材料学部、信息电子学部、经济管理学部、艺术学部、文理学部等5个教学学部，设有25个本科专业。   \\n                                                           - - - - - - 来源：[百度词条]\"}','{\"msg\":\"操作成功\",\"code\":200,\"data\":[\"南昌航空大学科技学院\",\"江西省教育厅\",\"江西省计划发展委员会\",\"\\\\n学院\",\"江西省赣江新区\",\"共青城市\",\"庐山\",\"鄱阳湖\",\"百度\"]}',0,NULL,'2022-02-19 12:45:25'),
