(1075,'分析字符串获取关键词',2,'com.nhXJH.web.controller.appllication.BaseFileController.analysisStr()','POST',1,'admin',NULL,'/userApplication/file/analysisStr','127.0.0.1','内网IP','{\"str\":\"  南昌大学图书馆，于1993年5月南昌大学成立时，由原江西大学图书馆和原江西工业大学图书馆合并而成，是学校的文献信息中心，是为教学和科学研究服务的学术性机构，是学校信息化和社会信息化的重要基地。并成为中国高等教育文献保障系统 (CALIS) 成员馆、 CALIS 江西省高校文献信息服务中心、教育部科技查新工作站（ L25 ）、江西省医学科技情报中心。\"}','{\"msg\":\"操作成功\",\"code\":200,\"data\":[]}',0,NULL,'2022-02-19 12:53:31'),
