(1291,'图书管理机构信息',1,'com.nhXJH.web.controller.appllication.LibraryMechanismController.add()','POST',1,'admin',NULL,'/userApplication/mechanism','127.0.0.1','内网IP','{\"deptName\":\"北京大学图书馆\",\"deptId\":128,\"createPerson\":1,\"params\":{},\"createBy\":\"admin\",\"createTime\":1645411416820,\"phone\":\"19970246857\",\"addr\":\"北京市:北京市:海淀区:颐和园路5号北京大学内(近中关村)\",\"mechanism\":{\"deptId\":128,\"createPerson\":1,\"params\":{},\"createTime\":1645411416820,\"phone\":\"19970246857\",\"addr\":\"北京市:北京市:海淀区:颐和园路5号北京大学内(近中关村)\",\"email\":\"PekingUniversityLy@pu.edu\",\"mark\":\"  北京大学图书馆（Peking University Library）成立于1898年，是中国最早的现代新型图书馆之一，被国务院批准为首批国家重点古籍保护单位，已发展成为资源丰富、现代化、综合性、开放式的研究型图书馆。\\n  北京大学图书馆前身为建立于1898年的京师大学堂藏书楼，辛亥革命后，京师大学堂藏书楼改名为北京大学图书馆；1952年，北京大学图书馆合并了原燕京大学图书馆；2000年，北京大学与北京医科大学合并，原北京医科大学图书馆改称北京大学医学图书馆。\\n  截至2015年底，北京大学图书馆由总馆、医学馆、38个分馆、储存馆组成，总面积约90000平米，其中，总馆面积约53000平米，阅览座位4000余个，2009年建成国内首例远程储存图书馆面积近5000平米；2014年，全馆人员（事业编制及合同制）学历构成：博士14人，硕士72人，本科66人，大专31人；总、分馆文献资源累积量约1100余万册（件），其中纸质藏书800余万册，以及大量引进和自建的国内外数字资源，包括各类数据库、电子期刊、电子图书和多媒体资源约300余万册（件）。\\n                                                      - - - - -来源：[百度词条]\",\"status\":\"1\"},\"contacts\":\"陈建龙\",\"email\":\"PekingUniversityLy@pu.edu\",\"mark\":\"  北京大学图书馆（Peking University Library）成立于1898年，是中国最早的现代新型图书馆之一，被国务院批准为首批国家重点古籍保护单位，已发展成为资源丰富、现代化、综合性、开放式的研究型图书馆。\\n  北京大学图书馆前身为建立于1898年的京师大学堂藏书楼，辛亥革命后，京师大学堂藏书楼改名为北京大学图书馆；1952年，北京大学图书馆合并了原燕京大学图书馆；2000年，北京大学与北京医科大学合并，原北京医科大学图书馆改称北京大学医学图书馆。\\n  截至2015年底，北京大学图书馆由总馆、医学馆、38个分馆、储存馆组成，总面积约90000平米，其中，总馆面积约53000平米，阅览座位4000余个，2009年建成国内首例远程储存图书馆面积近5000平米；2014年，全馆人员（事业编制及合同制）学历构成：博士14人，硕士72人，本科66人，大专31人；总、分馆文献资源累积量约1100余万册（件），其中纸质藏书800余万册，以及大量引进和自建的国内外数字资源，包括各类数据库、电子期刊、电子图书和多媒体资源约300余万册（件）。\\n                                                      - - - - -来源：[百度词条]\",\"status\":\"1\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2022-02-21 10:43:36'),
