(1297,'图书管理机构信息',1,'com.nhXJH.web.controller.appllication.LibraryMechanismController.add()','POST',1,'admin',NULL,'/userApplication/mechanism','127.0.0.1','内网IP','{\"deptName\":\"清华大学图书馆\",\"deptId\":129,\"createPerson\":1,\"params\":{},\"createBy\":\"admin\",\"createTime\":1645411658309,\"phone\":\"19970246857\",\"mechanism\":{\"deptId\":129,\"createPerson\":1,\"params\":{},\"createTime\":1645411658309,\"phone\":\"19970246857\",\"email\":\"TsinghuaUniversityLy@thu.edu\",\"mark\":\"  清华大学图书馆被国务院批准为首批国家重点古籍保护单位，目标是建成研究型、数字化和开放文明的现代化图书馆。 \\n  1912年清华学堂改建为清华学校，正式建立了小规模的图书室，称清华学校图书室；1919年3月图书室独立馆舍（现老馆东部）落成，更名为清华学校图书馆；1928年，更名为国立清华大学图书馆；1949年，更名为清华大学图书馆。\\n  截至2020年底，清华大学图书馆（含专业图书馆及院系资料室）的实体馆藏总量约548.46万册（件），形成了基本覆盖全学科、包含丰富文献类型和载体形式的综合性馆藏体系。图书馆系统由总馆及文科、美术、金融、法律、经管、建筑六个专业图书馆组成，馆舍总面积7万余平方米，阅览座位4000余席。           - - - - - 来源：[百度词条]\",\"status\":\"1\"},\"contacts\":\"王有强\",\"email\":\"TsinghuaUniversityLy@thu.edu\",\"mark\":\"  清华大学图书馆被国务院批准为首批国家重点古籍保护单位，目标是建成研究型、数字化和开放文明的现代化图书馆。 \\n  1912年清华学堂改建为清华学校，正式建立了小规模的图书室，称清华学校图书室；1919年3月图书室独立馆舍（现老馆东部）落成，更名为清华学校图书馆；1928年，更名为国立清华大学图书馆；1949年，更名为清华大学图书馆。\\n  截至2020年底，清华大学图书馆（含专业图书馆及院系资料室）的实体馆藏总量约548.46万册（件），形成了基本覆盖全学科、包含丰富文献类型和载体形式的综合性馆藏体系。图书馆系统由总馆及文科、美术、金融、法律、经管、建筑六个专业图书馆组成，馆舍总面积7万余平方米，阅览座位4000余席。           - - - - - 来源：[百度词条]\",\"status\":\"1\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2022-02-21 10:47:38'),
