(1340,'图书管理机构信息',1,'com.nhXJH.web.controller.appllication.LibraryMechanismController.add()','POST',1,'admin',NULL,'/userApplication/mechanism','127.0.0.1','内网IP','{\"deptName\":\"浙江图书馆\",\"deptId\":130,\"createPerson\":1,\"params\":{},\"createBy\":\"admin\",\"createTime\":1645413655595,\"phone\":\"87988700\",\"addr\":\"浙江省:杭州市:西湖区:曙光路73号\",\"mechanism\":{\"deptId\":130,\"createPerson\":1,\"params\":{},\"createTime\":1645413655595,\"phone\":\"87988700\",\"addr\":\"浙江省:杭州市:西湖区:曙光路73号\",\"email\":\"zjdh@zjlib.cn\",\"mark\":\"  浙江图书馆，位于浙江省杭州市，是中国国内创办最早的省级公共图书馆之一，是首批“全国古籍重点保护单位”，是原中华人民共和国文化部评定的“一级图书馆”、是全国文化信息资源共享工程浙江省分中心、全国图书馆联合编目中心浙江省分中心、长三角公共图书馆讲座联盟。\\n  浙江图书馆创建于1900年，前身是杭州藏书楼，1909年浙江官书局并入，成立浙江图书馆；1951年接收藏书家刘承干捐赠的南浔嘉业堂藏书楼及藏书；1953年，确定使用“浙江图书馆”为馆名；2000年11月，浙江图书馆百年华诞之际，浙江图书馆新馆正式开馆。 \\n  截至2016年，浙江图书馆建筑总面积4.7万平方米，在全省各地设有24个分馆、29个流通站，馆藏文献共673.44万册（件），其中，古籍线装书82.2万册，含善本15万册；报刊合订本90.77万册；馆藏雕版15万件；馆藏电子图书174.82万册。 图书馆有阅览座位1359席，全馆员工282人。\",\"status\":\"1\"},\"contacts\":\"褚树青\",\"email\":\"zjdh@zjlib.cn\",\"mark\":\"  浙江图书馆，位于浙江省杭州市，是中国国内创办最早的省级公共图书馆之一，是首批“全国古籍重点保护单位”，是原中华人民共和国文化部评定的“一级图书馆”、是全国文化信息资源共享工程浙江省分中心、全国图书馆联合编目中心浙江省分中心、长三角公共图书馆讲座联盟。\\n  浙江图书馆创建于1900年，前身是杭州藏书楼，1909年浙江官书局并入，成立浙江图书馆；1951年接收藏书家刘承干捐赠的南浔嘉业堂藏书楼及藏书；1953年，确定使用“浙江图书馆”为馆名；2000年11月，浙江图书馆百年华诞之际，浙江图书馆新馆正式开馆。 \\n  截至2016年，浙江图书馆建筑总面积4.7万平方米，在全省各地设有24个分馆、29个流通站，馆藏文献共673.44万册（件），其中，古籍线装书82.2万册，含善本15万册；报刊合订本90.77万册；馆藏雕版15万件；馆藏电子图书174.82万册。 图书馆有阅览座位1359席，全馆员工282人。\",\"status\":\"1\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2022-02-21 11:20:55'),
