(1351,'图书管理机构信息',1,'com.nhXJH.web.controller.appllication.LibraryMechanismController.add()','POST',1,'admin',NULL,'/userApplication/mechanism','127.0.0.1','内网IP','{\"deptName\":\"湖南图书馆（Hunan Library）\",\"deptId\":131,\"createPerson\":1,\"params\":{},\"createBy\":\"admin\",\"createTime\":1645414236789,\"phone\":\"0000000\",\"addr\":\"湖南省:长沙市:芙蓉区:韶山北路168号\",\"mechanism\":{\"deptId\":131,\"createPerson\":1,\"params\":{},\"createTime\":1645414236789,\"phone\":\"0000000\",\"addr\":\"湖南省:长沙市:芙蓉区:韶山北路168号\",\"email\":\"web@library.hn.cn\",\"mark\":\"  湖南图书馆（Hunan Library）是国家举办的省级综合性公共图书馆，是中国国内第一家以“图书馆”命名的省级公共图书馆。\\n  湖南图书馆建立于1904年3月，由梁焕奎等人募捐、湖南巡抚赵尔巽准令于古定王台创办的湖南图书馆兼教育博物馆。1912年，湖南图书馆改名“省立湖南图书馆” 。1984年7月，由湖南省编制委员会行文，同意湖南省图书馆改名为湖南图书馆。\\n  据2017年2月图书馆官网显示，湖南图书馆馆舍主楼面积2.3万平方米，培训楼6700余平方米，馆藏实体文献450余万册（件），其中图书308余万册（件），古籍线装书80余万册（件），报刊55余万册（件），视听与缩微制品20余万件。电子图书达330万余种。设有阅览座位1570余个。\\n                                                                       - - - - - - 来源：[百度词条]\",\"status\":\"1\"},\"contacts\":\"张勇\",\"email\":\"web@library.hn.cn\",\"mark\":\"  湖南图书馆（Hunan Library）是国家举办的省级综合性公共图书馆，是中国国内第一家以“图书馆”命名的省级公共图书馆。\\n  湖南图书馆建立于1904年3月，由梁焕奎等人募捐、湖南巡抚赵尔巽准令于古定王台创办的湖南图书馆兼教育博物馆。1912年，湖南图书馆改名“省立湖南图书馆” 。1984年7月，由湖南省编制委员会行文，同意湖南省图书馆改名为湖南图书馆。\\n  据2017年2月图书馆官网显示，湖南图书馆馆舍主楼面积2.3万平方米，培训楼6700余平方米，馆藏实体文献450余万册（件），其中图书308余万册（件），古籍线装书80余万册（件），报刊55余万册（件），视听与缩微制品20余万件。电子图书达330万余种。设有阅览座位1570余个。\\n                                                                       - - - - - - 来源：[百度词条]\",\"status\":\"1\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2022-02-21 11:30:37'),
