(1358,'图书管理机构信息',1,'com.nhXJH.web.controller.appllication.LibraryMechanismController.add()','POST',1,'admin',NULL,'/userApplication/mechanism','127.0.0.1','内网IP','{\"deptName\":\"上海图书馆\",\"deptId\":132,\"createPerson\":1,\"params\":{},\"createBy\":\"admin\",\"createTime\":1645414651407,\"phone\":\"02164455555\",\"addr\":\"上海市:上海市:徐汇区:淮海中路1555号\",\"mechanism\":{\"deptId\":132,\"createPerson\":1,\"params\":{},\"createTime\":1645414651407,\"phone\":\"02164455555\",\"addr\":\"上海市:上海市:徐汇区:淮海中路1555号\",\"email\":\"library@sh.cn\",\"mark\":\"  上海图书馆（Shanghai Library）位于上海市徐汇区淮海中路，是上海市综合性研究型公共图书馆和行业情报中心，也是全国文化信息资源共享工程上海市分中心、文化部公共文化研究基地，是首批国家重点古籍保护单位。\\n  上海图书馆创立于1952年，上海科学技术情报研究所成立于1958年，1995年上海图书馆与上海科学技术情报研究所合并，1996年12月上海图书馆新馆正式对外开放。 \\n  截至2015年底，上海图书馆建筑面积12.7万平方米，拥有各类阅览室36个，设有24个机构部门，在编职工751人。图书馆藏有中外文献5600余万册（件），其中中文古籍线装书约170万余册，善本2.5万种17万册，属国家一、二级藏品2256种13526册。\",\"status\":\"1\"},\"contacts\":\"陈超\",\"email\":\"library@sh.cn\",\"mark\":\"  上海图书馆（Shanghai Library）位于上海市徐汇区淮海中路，是上海市综合性研究型公共图书馆和行业情报中心，也是全国文化信息资源共享工程上海市分中心、文化部公共文化研究基地，是首批国家重点古籍保护单位。\\n  上海图书馆创立于1952年，上海科学技术情报研究所成立于1958年，1995年上海图书馆与上海科学技术情报研究所合并，1996年12月上海图书馆新馆正式对外开放。 \\n  截至2015年底，上海图书馆建筑面积12.7万平方米，拥有各类阅览室36个，设有24个机构部门，在编职工751人。图书馆藏有中外文献5600余万册（件），其中中文古籍线装书约170万余册，善本2.5万种17万册，属国家一、二级藏品2256种13526册。\",\"status\":\"1\"}','{\"msg\":\"操作成功\",\"code\":200}',0,NULL,'2022-02-21 11:37:31'),
