(1516,'作信息者',1,'com.nhXJH.web.controller.appllication.LibraryAuthController.add()','POST',1,'admin',NULL,'/userApplication/auth','127.0.0.1','内网IP','{\"country\":\"中国\",\"englishName\":\"MoYan\",\"auth\":{\"country\":\"中国\",\"englishName\":\"MoYan\",\"nickName\":\"管谟业\",\"sex\":1,\"synopsis\":\"  莫言，本名管谟业，男，1955年2月17日生于山东省高密县河涯乡平安庄（现为高密市东北乡文化发展区大栏平安村），中国当代作家，中共党员。现为北京师范大学教授，国际写作中心主任，河北大学特聘教授。。2012年10月，成为首位中国籍诺贝尔文学奖获得者。\\n  1966年，辍学回乡放牧牛羊。1973年8月，作为农民合同工到高密县第五棉油厂工作。1976年2月，参军，曾任战士、班长、教员、干事等职。1978年，开始进行文学创作。1981年，发表处女作短篇小说《春夜雨霏霏》，展露文学天赋。1984年9月，考入原解放军艺术学院文学系。1985年，发表成名作中篇小说《透明的红萝卜》。1986年，发表中篇小说《红高粱》，在文坛引起轰动。1987年，《红高粱》被张艺谋改编为同名电影，莫言担任编剧。1988年，《红高粱》获得西柏林国际电影节金熊奖；同年发表长篇小说《天堂蒜薹之歌》。1989年，出版长篇小说《食草家族》。   \\n         - - - - - 来源：[百度词条]\",\"params\":{},\"createTime\":1645427757346,\"identity\":\"中国当代作家,中共党员,北京师范大学教授,国际写作中心主任,河北大学特聘教授,中国籍诺贝尔文学奖获得者,香港大学荣誉文学博士\",\"name\":\"莫言\",\"createPersonal\":1,\"status\":\"1\"},\"nickName\":\"管谟业\",\"sex\":1,\"synopsis\":\"  莫言，本名管谟业，男，1955年2月17日生于山东省高密县河涯乡平安庄（现为高密市东北乡文化发展区大栏平安村），中国当代作家，中共党员。现为北京师范大学教授，国际写作中心主任，河北大学特聘教授。。2012年10月，成为首位中国籍诺贝尔文学奖获得者。\\n  1966年，辍学回乡放牧牛羊。1973年8月，作为农民合同工到高密县第五棉油厂工作。1976年2月，参军，曾任战士、班长、教员、干事等职。1978年，开始进行文学创作。1981年，发表处女作短篇小说《春夜雨霏霏》，展露文学天赋。1984年9月，考入原解放军艺术学院文学系。1985年，发表成名作中篇小说《透明的红萝卜》。1986年，发表中篇小说《红高粱》，在文坛引起轰动。1987年，《红高粱》被张艺谋改编为同名电影，莫言担任编剧。1988年，《红高粱》获得西柏林国际电影节金熊奖；同年发表长篇小说《天堂蒜薹之歌》。1989年，出版长篇小说《食草家族》。   \\n         - - - - - 来源：[百度词条]\",\"params\":{},\"createTime\":1645427757346,\"identity\":\"中国当代作家,中共党员,北京师范大学教授,国际写作中心主任,河北大学特聘教授,中国籍诺贝尔文学奖获得者,香港大学荣誉文学博士\",\"picList\":[{\"createPerson\":1,\"url\":\"/profile/avatar/2022/02/21/bcab9765-ac5a-43ee-90be-a8b9ecec2831.png\",\"groudId\":-8941162038729720000,\"newName\":\"2022/02/21/149380dd-2ba1-444f-b501-850d747e58f4.png\",\"createTime\":1645427755177,\"name\":\"作家-莫言.png\",\"id\":152,\"status\":0}],\"name\":\"莫言\",\"createPersonal\":1,\"status\":\"1\"}','{\"msg\":\"操作成功\",\"code\":200,\"data\":[{\"createPerson\":1,\"createTime\":1645427757355,\"dbId\":26,\"fileId\":152,\"params\":{},\"url\":\"/profile/avatar/2022/02/21/bcab9765-ac5a-43ee-90be-a8b9ecec2831.png\"}]}',0,NULL,'2022-02-21 15:15:57'),
