(1521,'作信息者',1,'com.nhXJH.web.controller.appllication.LibraryAuthController.add()','POST',1,'admin',NULL,'/userApplication/auth','127.0.0.1','内网IP','{\"country\":\"中国\",\"englishName\":\"TuYouYou\",\"auth\":{\"country\":\"中国\",\"englishName\":\"TuYouYou\",\"nickName\":\"屠呦呦\",\"sex\":2,\"synopsis\":\"  屠呦呦，女，1930年12月30日出生于浙江宁波，汉族，中共党员，药学家。1951年考入北京大学医学院药学系生药专业。1955年毕业于北京医学院（今北京大学医学部）。毕业后接受中医培训两年半，并一直在中国中医研究院（2005年更名为中国中医科学院）工作，期间晋升为硕士生导师、博士生导师。现为中国中医科学院首席科学家，终身研究员兼首席研究员 ，青蒿素研究开发中心主任，博士生导师，共和国勋章获得者。\\n  多年从事中药和中西药结合研究，突出贡献是创制新型抗疟药青蒿素和双氢青蒿素。1972年成功提取分子式为C15H22O5的无色结晶体，命名为青蒿素。2011年9月，因发现青蒿素——一种用于治疗疟疾的药物，挽救了全球特别是发展中国家数百万人的生命获得拉斯克奖和葛兰素史克中国研发中心“生命科学杰出成就奖” [8]  。2015年10月获得诺贝尔生理学或医学奖，理由是她发现了青蒿素，该药品可以有效降低疟疾患者的死亡率。她成为首获科学类诺贝尔奖的中国人。\\n  第一位获诺贝尔科学奖项的中国本土科学家。\",\"params\":{},\"createTime\":1645428203404,\"identity\":\"中共党员,药学家,中国中医科学院首席科学家,终身研究员,首席研究员,青蒿素研究开发中心主任,博士生导师,共和国勋章获得者\",\"name\":\"屠呦呦\",\"createPersonal\":1,\"status\":\"1\"},\"nickName\":\"屠呦呦\",\"sex\":2,\"synopsis\":\"  屠呦呦，女，1930年12月30日出生于浙江宁波，汉族，中共党员，药学家。1951年考入北京大学医学院药学系生药专业。1955年毕业于北京医学院（今北京大学医学部）。毕业后接受中医培训两年半，并一直在中国中医研究院（2005年更名为中国中医科学院）工作，期间晋升为硕士生导师、博士生导师。现为中国中医科学院首席科学家，终身研究员兼首席研究员 ，青蒿素研究开发中心主任，博士生导师，共和国勋章获得者。\\n  多年从事中药和中西药结合研究，突出贡献是创制新型抗疟药青蒿素和双氢青蒿素。1972年成功提取分子式为C15H22O5的无色结晶体，命名为青蒿素。2011年9月，因发现青蒿素——一种用于治疗疟疾的药物，挽救了全球特别是发展中国家数百万人的生命获得拉斯克奖和葛兰素史克中国研发中心“生命科学杰出成就奖” [8]  。2015年10月获得诺贝尔生理学或医学奖，理由是她发现了青蒿素，该药品可以有效降低疟疾患者的死亡率。她成为首获科学类诺贝尔奖的中国人。\\n  第一位获诺贝尔科学奖项的中国本土科学家。\",\"params\":{},\"createTime\":1645428203404,\"identity\":\"中共党员,药学家,中国中医科学院首席科学家,终身研究员,首席研究员,青蒿素研究开发中心主任,博士生导师,共和国勋章获得者\",\"picList\":[{\"createPerson\":1,\"url\":\"/profile/avatar/2022/02/21/b2bfa209-9070-444e-a70f-27268dd706f4.png\",\"groudId\":-8072542179504495000,\"newName\":\"2022/02/21/c0bd8a4f-0d31-4108-9068-bf0c8f0f0289.png\",\"createTime\":1645428201035,\"name\":\"作家-屠呦呦.png\",\"id\":153,\"status\":0}],\"name\":\"屠呦呦\",\"createPersonal\":1,\"status\":\"1\"}','{\"msg\":\"操作成功\",\"code\":200,\"data\":[{\"createPerson\":1,\"createTime\":1645428203422,\"dbId\":26,\"fileId\":153,\"mark\":\"作家:屠呦呦\",\"modelId\":8,\"params\":{},\"url\":\"/profile/avatar/2022/02/21/b2bfa209-9070-444e-a70f-27268dd706f4.png\"}]}',0,NULL,'2022-02-21 15:23:23'),
