(1524,'作信息者',1,'com.nhXJH.web.controller.appllication.LibraryAuthController.add()','POST',1,'admin',NULL,'/userApplication/auth','127.0.0.1','内网IP','{\"country\":\"中国\",\"englishName\":\"Echo\",\"auth\":{\"country\":\"中国\",\"englishName\":\"Echo\",\"nickName\":\"陈平，陈懋平\",\"sex\":2,\"synopsis\":\"  三毛（1943年3月26日—1991年1月4日），本名陈平，祖籍浙江舟山市定海区，出生于重庆市南岸区黄桷垭，中国台湾当代女作家、旅行家。\\n  1967年，先后游学西班牙、德国、美国，并创作了散文集《雨季不再来》。1973年，定居西属撒哈拉沙漠，随后与荷西结婚。1976年2月，移居加那利群岛；5月，出版第一部散文集《撒哈拉的故事》，讲述夫妻二人在沙漠的生活经历。1977年到1979年，先后发表《哭泣的骆驼》《稻草人手记》《温柔的夜》等散文集。1980年，荷西意外逝世后回到台湾定居。1981年，出版散文集《梦里花落知多少》，表达对丈夫的思念之情。1982年，根据中南美洲旅行经历所创作的散文集《万水千山走遍》出版。1987年，出版散文集《我的宝贝》，展示她所收藏的一些物品。1990年，创作的第一部中文剧本，也是她的最后一部作品《滚滚红尘》出版 。1991年1月4日，在台湾荣民总医院逝世，终年四十七岁。\",\"params\":{},\"createTime\":1645428407254,\"identity\":\"作家,旅行家\",\"name\":\"三毛\",\"createPersonal\":1,\"status\":\"1\"},\"nickName\":\"陈平，陈懋平\",\"sex\":2,\"synopsis\":\"  三毛（1943年3月26日—1991年1月4日），本名陈平，祖籍浙江舟山市定海区，出生于重庆市南岸区黄桷垭，中国台湾当代女作家、旅行家。\\n  1967年，先后游学西班牙、德国、美国，并创作了散文集《雨季不再来》。1973年，定居西属撒哈拉沙漠，随后与荷西结婚。1976年2月，移居加那利群岛；5月，出版第一部散文集《撒哈拉的故事》，讲述夫妻二人在沙漠的生活经历。1977年到1979年，先后发表《哭泣的骆驼》《稻草人手记》《温柔的夜》等散文集。1980年，荷西意外逝世后回到台湾定居。1981年，出版散文集《梦里花落知多少》，表达对丈夫的思念之情。1982年，根据中南美洲旅行经历所创作的散文集《万水千山走遍》出版。1987年，出版散文集《我的宝贝》，展示她所收藏的一些物品。1990年，创作的第一部中文剧本，也是她的最后一部作品《滚滚红尘》出版 。1991年1月4日，在台湾荣民总医院逝世，终年四十七岁。\",\"params\":{},\"createTime\":1645428407254,\"identity\":\"作家,旅行家\",\"picList\":[{\"createPerson\":1,\"url\":\"/profile/avatar/2022/02/21/4133c109-2097-412f-9cc1-f803ab42d00f.png\",\"groudId\":-7870238147803055000,\"newName\":\"2022/02/21/f12cf643-0e75-4fa2-9925-b49f01349914.png\",\"createTime\":1645428402788,\"name\":\"作家-三毛.png\",\"id\":154,\"status\":0}],\"name\":\"三毛\",\"createPersonal\":1,\"status\":\"1\"}','{\"msg\":\"操作成功\",\"code\":200,\"data\":[{\"createPerson\":1,\"createTime\":1645428407259,\"dbId\":26,\"fileId\":154,\"mark\":\"作家:三毛\",\"modelId\":9,\"params\":{},\"url\":\"/profile/avatar/2022/02/21/4133c109-2097-412f-9cc1-f803ab42d00f.png\"}]}',0,NULL,'2022-02-21 15:26:47'),
