(1526,'作信息者',1,'com.nhXJH.web.controller.appllication.LibraryAuthController.add()','POST',1,'admin',NULL,'/userApplication/auth','127.0.0.1','内网IP','{\"country\":\"美国\",\"englishName\":\"Franklin Delano Roosevelt\",\"auth\":{\"country\":\"美国\",\"englishName\":\"Franklin Delano Roosevelt\",\"nickName\":\"富兰克林·德拉诺·罗斯福\",\"sex\":1,\"synopsis\":\"富兰克林·德拉诺·罗斯福（Franklin Delano Roosevelt）（1882年1月30日—1945年4月12日） 简称FDR，华人将其称为“小罗斯福”，美国第32任总统，美国历史上首位连任四届（病逝于第四届任期中）的总统。1911年，罗斯福进入纽约州参议院，直至1913年被威尔逊总统任命为助理海军部长，1920年去职。1929至1932年，任纽约州州长一职，并于1932年击败胡佛，当选为美国总统。在1930年代经济大萧条期间，罗斯福推行新政以提供失业救济与复苏经济，并成立众多机构来改革经济和银行体系，从经济危机的深渊中挽救了美国。1941年，偷袭珍珠港事件发生后，罗斯福力主对日本宣战，并引进了价格管制和配给。罗斯福以租借法案使美国转变为“民主国家的兵工厂”，使美国成为同盟国主要的军火供应商和融资者，也使得美国国内产业大幅扩张，实现充分就业。二战后期同盟国逐渐扭转形势后，罗斯福对塑造战后世界秩序发挥了关键作用，其影响力在雅尔塔会议及联合国的成立中尤其明显。1945年4月12日，罗斯福在佐治亚州的温泉因突发脑溢血去世,罗斯福是第二次世界大战期间反法西斯同盟阵营的重要领导人之一。\",\"params\":{},\"createTime\":1645428787289,\"identity\":\"美国第32任总统,反法西斯同盟阵营的重要领导人,美国最佳总统,政治家,军事家,世界和平人物\",\"name\":\"富兰克林·罗斯福\",\"createPersonal\":1,\"status\":\"1\"},\"nickName\":\"富兰克林·德拉诺·罗斯福\",\"sex\":1,\"synopsis\":\"富兰克林·德拉诺·罗斯福（Franklin Delano Roosevelt）（1882年1月30日—1945年4月12日） 简称FDR，华人将其称为“小罗斯福”，美国第32任总统，美国历史上首位连任四届（病逝于第四届任期中）的总统。1911年，罗斯福进入纽约州参议院，直至1913年被威尔逊总统任命为助理海军部长，1920年去职。1929至1932年，任纽约州州长一职，并于1932年击败胡佛，当选为美国总统。在1930年代经济大萧条期间，罗斯福推行新政以提供失业救济与复苏经济，并成立众多机构来改革经济和银行体系，从经济危机的深渊中挽救了美国。1941年，偷袭珍珠港事件发生后，罗斯福力主对日本宣战，并引进了价格管制和配给。罗斯福以租借法案使美国转变为“民主国家的兵工厂”，使美国成为同盟国主要的军火供应商和融资者，也使得美国国内产业大幅扩张，实现充分就业。二战后期同盟国逐渐扭转形势后，罗斯福对塑造战后世界秩序发挥了关键作用，其影响力在雅尔塔会议及联合国的成立中尤其明显。1945年4月12日，罗斯福在佐治亚州的温泉因突发脑溢血去世,罗斯福是第二次世界大战期间反法西斯同盟阵营的重要领导人之一。\",\"params\":{},\"createTime\":1645428787289,\"identity\":\"美国第32任总统,反法西斯同盟阵营的重要领导人,美国最佳总统,政治家,军事家,世界和平人物\",\"picList\":[{\"createPerson\":1,\"url\":\"/profile/avatar/2022/02/21/43e705ed-7dd1-4a49-ade0-856ecfe47354.png\",\"groudId\":-7457452533722059000,\"newName\":\"2022/02/21/9b20df88-8390-4b90-8835-fe2de7bae8ba.png\",\"createTime\":1645428785211,\"name\":\"作家-富兰克林.png\",\"id\":155,\"status\":0}],\"name\":\"富兰克林·罗斯福\",\"createPersonal\":1,\"status\":\"1\"}','{\"msg\":\"操作成功\",\"code\":200,\"data\":[{\"createPerson\":1,\"createTime\":1645428787293,\"dbId\":26,\"fileId\":155,\"mark\":\"作家:富兰克林·罗斯福\",\"modelId\":10,\"params\":{},\"url\":\"/profile/avatar/2022/02/21/43e705ed-7dd1-4a49-ade0-856ecfe47354.png\"}]}',0,NULL,'2022-02-21 15:33:07'),
(1527,'作信息者',1,'com.nhXJH.web.controller.appllication.LibraryAuthController.add()','POST',1,'admin',NULL,'/userApplication/auth','127.0.0.1','内网IP','{\"country\":\"美国\",\"englishName\":\"Ernest Miller Hemingway\",\"auth\":{\"country\":\"美国\",\"englishName\":\"Ernest Miller Hemingway\",\"nickName\":\"欧内斯特·米勒尔·海明威\",\"sex\":1,\"synopsis\":\"  欧内斯特·米勒尔·海明威（Ernest Miller Hemingway，1899年7月21日－1961年7月2日），出生于美国伊利诺伊州芝加哥市郊区奥克帕克，美国作家、记者，被认为是20世纪最著名的小说家之一。\\n  海明威的一生之中曾荣获不少奖项。他在第一次世界大战期间被授予银制勇敢勋章；1953年，他以《老人与海》一书获得普利策奖；1954年的《老人与海》又为海明威夺得诺贝尔文学奖。2001年，海明威的《太阳照样升起》（The Sun Also Rises）与《永别了，武器》两部作品被美国现代图书馆列入“20世纪中的100部最佳英文小说”中。\\n  1961年7月2日，海明威在爱达荷州凯彻姆的家中用猎枪自杀身亡，享年61岁。\\n  海明威一生中的感情错综复杂，先后结过四次婚，是美国“迷惘的一代”（Lost Generation）作家中的代表人物，作品中对人生、世界、社会都表现出了迷茫和彷徨。他一向以文坛硬汉著称，他是美利坚民族的精神丰碑。海明威的作品标志着他独特创作风格的形成，在美国文学史乃至世界文学史上都占有重要地位。\",\"params\":{},\"createTime\":1645428970590,\"identity\":\"作家,记者,1954年诺贝尔文学奖获得者,“新闻体”小说的创始人\",\"name\":\"海明威\",\"createPersonal\":1,\"status\":\"1\"},\"nickName\":\"欧内斯特·米勒尔·海明威\",\"sex\":1,\"synopsis\":\"  欧内斯特·米勒尔·海明威（Ernest Miller Hemingway，1899年7月21日－1961年7月2日），出生于美国伊利诺伊州芝加哥市郊区奥克帕克，美国作家、记者，被认为是20世纪最著名的小说家之一。\\n  海明威的一生之中曾荣获不少奖项。他在第一次世界大战期间被授予银制勇敢勋章；1953年，他以《老人与海》一书获得普利策奖；1954年的《老人与海》又为海明威夺得诺贝尔文学奖。2001年，海明威的《太阳照样升起》（The Sun Also Rises）与《永别了，武器》两部作品被美国现代图书馆列入“20世纪中的100部最佳英文小说”中。\\n  1961年7月2日，海明威在爱达荷州凯彻姆的家中用猎枪自杀身亡，享年61岁。\\n  海明威一生中的感情错综复杂，先后结过四次婚，是美国“迷惘的一代”（Lost Generation）作家中的代表人物，作品中对人生、世界、社会都表现出了迷茫和彷徨。他一向以文坛硬汉著称，他是美利坚民族的精神丰碑。海明威的作品标志着他独特创作风格的形成，在美国文学史乃至世界文学史上都占有重要地位。\",\"params\":{},\"createTime\":1645428970590,\"identity\":\"作家,记者,1954年诺贝尔文学奖获得者,“新闻体”小说的创始人\",\"picList\":[{\"createPerson\":1,\"url\":\"/profile/avatar/2022/02/21/d2c109bd-498a-436a-bdbf-347796f88ae7.png\",\"groudId\":-5818041516973277000,\"newName\":\"2022/02/21/d7a07317-2f41-4318-abd6-d1dd98f2e36e.png\",\"createTime\":1645428967350,\"name\":\"作家-海明威.png\",\"id\":156,\"status\":0}],\"name\":\"海明威\",\"createPersonal\":1,\"status\":\"1\"}','{\"msg\":\"操作成功\",\"code\":200,\"data\":[{\"createPerson\":1,\"createTime\":1645428970594,\"dbId\":26,\"fileId\":156,\"mark\":\"作家:海明威\",\"modelId\":11,\"params\":{},\"url\":\"/profile/avatar/2022/02/21/d2c109bd-498a-436a-bdbf-347796f88ae7.png\"}]}',0,NULL,'2022-02-21 15:36:10'),
