(1529,'作信息者',1,'com.nhXJH.web.controller.appllication.LibraryAuthController.add()','POST',1,'admin',NULL,'/userApplication/auth','127.0.0.1','内网IP','{\"country\":\"中国\",\"englishName\":\"Confucius\",\"auth\":{\"country\":\"中国\",\"englishName\":\"Confucius\",\"nickName\":\"孔子、尼父、孔夫子，字仲尼\",\"sex\":1,\"synopsis\":\"  孔子（公元前551年9月28日-公元前479年4月11日），子姓，孔氏，名丘，字仲尼，鲁国陬邑（今山东省曲阜市）人，祖籍宋国栗邑（今河南省夏邑县），中国古代伟大的思想家、政治家、教育家，儒家学派创始人、“大成至圣先师”。\\n  孔子开创私人讲学之风，倡导仁义礼智信。有弟子三千，其中贤人七十二。曾带领部分弟子周游列国十四年，晚年修订六经（《诗》《书》《礼》《乐》《易》《春秋》）。去世后，其弟子及再传弟子把孔子及其弟子的言行语录和思想记录下来，整理编成《论语》。该书被奉为儒家经典。\\n  孔子是当时社会上最博学者之一，在世时就被尊奉为“天纵之圣”“天之木铎”，更被后世统治者尊为孔圣人、至圣、至圣先师、大成至圣文宣王先师、万世师表。其思想对中国和世界都有深远的影响，其人被列为“世界十大文化名人”之首。随着孔子影响力的扩大，祭祀孔子的“祭孔大典”一度成为和中国祖先神祭祀同等级别的大祀。\",\"params\":{},\"createTime\":1645429158848,\"identity\":\"儒家学派创始人,中国古代伟大的思想家,政治家,教育家,儒家学派创始人,“大成至圣先师”\",\"name\":\"孔子\",\"createPersonal\":1,\"status\":\"1\"},\"nickName\":\"孔子、尼父、孔夫子，字仲尼\",\"sex\":1,\"synopsis\":\"  孔子（公元前551年9月28日-公元前479年4月11日），子姓，孔氏，名丘，字仲尼，鲁国陬邑（今山东省曲阜市）人，祖籍宋国栗邑（今河南省夏邑县），中国古代伟大的思想家、政治家、教育家，儒家学派创始人、“大成至圣先师”。\\n  孔子开创私人讲学之风，倡导仁义礼智信。有弟子三千，其中贤人七十二。曾带领部分弟子周游列国十四年，晚年修订六经（《诗》《书》《礼》《乐》《易》《春秋》）。去世后，其弟子及再传弟子把孔子及其弟子的言行语录和思想记录下来，整理编成《论语》。该书被奉为儒家经典。\\n  孔子是当时社会上最博学者之一，在世时就被尊奉为“天纵之圣”“天之木铎”，更被后世统治者尊为孔圣人、至圣、至圣先师、大成至圣文宣王先师、万世师表。其思想对中国和世界都有深远的影响，其人被列为“世界十大文化名人”之首。随着孔子影响力的扩大，祭祀孔子的“祭孔大典”一度成为和中国祖先神祭祀同等级别的大祀。\",\"params\":{},\"createTime\":1645429158848,\"identity\":\"儒家学派创始人,中国古代伟大的思想家,政治家,教育家,儒家学派创始人,“大成至圣先师”\",\"picList\":[{\"createPerson\":1,\"url\":\"/profile/avatar/2022/02/21/431578b5-635f-4575-8c89-d99e97c239d3.png\",\"groudId\":-6501692252943871000,\"newName\":\"2022/02/21/d110efd1-861e-4a98-8a1b-de3871ff50ad.png\",\"createTime\":1645429155531,\"name\":\"作者-孔子.png\",\"id\":157,\"status\":0}],\"name\":\"孔子\",\"createPersonal\":1,\"status\":\"1\"}','{\"msg\":\"操作成功\",\"code\":200,\"data\":[{\"createPerson\":1,\"createTime\":1645429158852,\"dbId\":26,\"fileId\":157,\"mark\":\"作家:孔子\",\"modelId\":12,\"params\":{},\"url\":\"/profile/avatar/2022/02/21/431578b5-635f-