(1531,'作信息者',1,'com.nhXJH.web.controller.appllication.LibraryAuthController.add()','POST',1,'admin',NULL,'/userApplication/auth','127.0.0.1','内网IP','{\"country\":\"中国\",\"englishName\":\"Mao\",\"auth\":{\"country\":\"中国\",\"englishName\":\"Mao\",\"nickName\":\"子任、石三伢子、二十八画生\",\"sex\":1,\"synopsis\":\"  毛泽东（1893年12月26日-1976年9月9日），字润之（原作咏芝，后改润芝），笔名子任。湖南湘潭人。中国人民的领袖，伟大的马克思主义者，伟大的无产阶级革命家  、战略家、理论家，中国共产党、中国人民解放军和中华人民共和国的主要缔造者和领导人，马克思主义中国化的伟大开拓者，近代以来中国伟大的爱国者和民族英雄，中国共产党第一代中央领导集体的核心，领导中国人民彻底改变自己命运和国家面貌的一代伟人。\\n  1949至1976年，毛泽东担任中华人民共和国最高领导人。他对马克思列宁主义的发展、军事理论的贡献以及对共产党的理论贡献被称为毛泽东思想。因毛泽东担任过的主要职务几乎全部称为主席，所以也被人们尊称为“毛主席”。\\n  毛泽东被视为现代世界历史中最重要的人物之一，《时代》杂志也将他评为20世纪最具影响100人之一。\",\"params\":{},\"createTime\":1645429423718,\"identity\":\"中国人民的领袖,伟大的马克思主义者,伟大的无产阶级革命家 ,战略家,理论家,中国共产党,中国人民解放军和中华人民共和国的主要缔造者和领导人,马克思主义中国化的伟大开拓者,近代以来中国伟大的爱国者和民族英雄,中国共产党第一代中央领导集体的核心\",\"name\":\"毛泽东\",\"createPersonal\":1,\"status\":\"1\"},\"nickName\":\"子任、石三伢子、二十八画生\",\"sex\":1,\"synopsis\":\"  毛泽东（1893年12月26日-1976年9月9日），字润之（原作咏芝，后改润芝），笔名子任。湖南湘潭人。中国人民的领袖，伟大的马克思主义者，伟大的无产阶级革命家  、战略家、理论家，中国共产党、中国人民解放军和中华人民共和国的主要缔造者和领导人，马克思主义中国化的伟大开拓者，近代以来中国伟大的爱国者和民族英雄，中国共产党第一代中央领导集体的核心，领导中国人民彻底改变自己命运和国家面貌的一代伟人。\\n  1949至1976年，毛泽东担任中华人民共和国最高领导人。他对马克思列宁主义的发展、军事理论的贡献以及对共产党的理论贡献被称为毛泽东思想。因毛泽东担任过的主要职务几乎全部称为主席，所以也被人们尊称为“毛主席”。\\n  毛泽东被视为现代世界历史中最重要的人物之一，《时代》杂志也将他评为20世纪最具影响100人之一。\",\"params\":{},\"createTime\":1645429423718,\"identity\":\"中国人民的领袖,伟大的马克思主义者,伟大的无产阶级革命家 ,战略家,理论家,中国共产党,中国人民解放军和中华人民共和国的主要缔造者和领导人,马克思主义中国化的伟大开拓者,近代以来中国伟大的爱国者和民族英雄,中国共产党第一代中央领导集体的核心\",\"picList\":[{\"createPerson\":1,\"url\":\"/profile/avatar/2022/02/21/8296a002-d62d-4760-89b5-8aaad9732c53.png\",\"groudId\":-6833800603927069000,\"newName\":\"2022/02/21/5e89ae3d-83ac-4d8e-a014-7fabde6cc016.png\",\"createTime\":1645429418816,\"name\":\"作家-毛泽东.png\",\"id\":158,\"status\":0}],\"name\":\"毛泽东\",\"createPersonal\":1,\"status\":\"1\"}','{\"msg\":\"操作成功\",\"code\":200,\"data\":[{\"createPerson\":1,\"createTime\":1645429423720,\"dbId\":26,\"fileId\":158,\"mark\":\"作家:毛泽东\",