(1534,'作信息者',1,'com.nhXJH.web.controller.appllication.LibraryAuthController.add()','POST',1,'admin',NULL,'/userApplication/auth','127.0.0.1','内网IP','{\"country\":\"法国\",\"englishName\":\"Victor Hugo\",\"auth\":{\"country\":\"法国\",\"englishName\":\"Victor Hugo\",\"nickName\":\"维克多·雨果，法兰西的莎士比亚\",\"sex\":1,\"synopsis\":\"  维克多·雨果（ 英文名：Victor Hugo，1802年2月26日—1885年5月22日），法国19世纪前期积极浪漫主义文学的代表作家，人道主义的代表人物，法国文学史上卓越的资产阶级民主作家，被人们称为“法兰西的莎士比亚”。一生写过多部诗歌、小说、剧本、各种散文和文艺评论及政论文章，在法国及世界有着广泛的影响力。\\n  1802年2月26日，雨果生于法国贝桑松，上有兄长二人。13岁时与兄长进入寄读学校就学，兄弟均成为学生领袖。他在16岁时已能创作杰出的诗句，21岁时出版诗集，声名大噪。1845年，法王路易·菲利普授予雨果上议院议员职位，自此专心从政。1848年法国二月革命爆发，法王路易被逊位。雨果于此时期四处奔走宣传革命，为人民贡献良多，赢得新共和政体的尊敬，晋封伯爵，并当选国民代表及国会议员。三年后，拿破仑三世称帝，他对此大加攻击，因此被放逐国外。此后20年间各处漂泊，此时期完成小说《悲惨世界》。1870年法国恢复共和政体（法兰西第三共和国），雨果结束流亡生涯，回到法国。1885年5月22日，雨果辞世，于潘德拉举行国葬。\",\"params\":{},\"createTime\":1645429783063,\"identity\":\"浪漫主义文学的代表作家,人道主义的代表人物,资产阶级民主作家,革命家\",\"name\":\"雨果\",\"createPersonal\":1,\"status\":\"1\"},\"nickName\":\"维克多·雨果，法兰西的莎士比亚\",\"sex\":1,\"synopsis\":\"  维克多·雨果（ 英文名：Victor Hugo，1802年2月26日—1885年5月22日），法国19世纪前期积极浪漫主义文学的代表作家，人道主义的代表人物，法国文学史上卓越的资产阶级民主作家，被人们称为“法兰西的莎士比亚”。一生写过多部诗歌、小说、剧本、各种散文和文艺评论及政论文章，在法国及世界有着广泛的影响力。\\n  1802年2月26日，雨果生于法国贝桑松，上有兄长二人。13岁时与兄长进入寄读学校就学，兄弟均成为学生领袖。他在16岁时已能创作杰出的诗句，21岁时出版诗集，声名大噪。1845年，法王路易·菲利普授予雨果上议院议员职位，自此专心从政。1848年法国二月革命爆发，法王路易被逊位。雨果于此时期四处奔走宣传革命，为人民贡献良多，赢得新共和政体的尊敬，晋封伯爵，并当选国民代表及国会议员。三年后，拿破仑三世称帝，他对此大加攻击，因此被放逐国外。此后20年间各处漂泊，此时期完成小说《悲惨世界》。1870年法国恢复共和政体（法兰西第三共和国），雨果结束流亡生涯，回到法国。1885年5月22日，雨果辞世，于潘德拉举行国葬。\",\"params\":{},\"createTime\":1645429783063,\"identity\":\"浪漫主义文学的代表作家,人道主义的代表人物,资产阶级民主作家,革命家\",\"picList\":[{\"createPerson\":1,\"url\":\"/profile/avatar/2022/02/21/9015b25f-ab24-4470-a964-2109c3f000c0.png\",\"groudId\":-7434258083951202000,\"newName\":\"2022/02/21/b647b3a8-3232-47fd-bfa8-7f28ed40fbf5.png\",\"createTime\":1645429781277,\"name\":\"作家-雨果.png\",\"id\":159,\"status\":0}],\"name\":\"雨果\",\"createPersonal\":1,\"status\":\"1\"}','{\"msg\":\"操作成功\",\"code\":200,\"data\":[{\"createPerson\":1,\"createTime\":1645429783072,\"dbId\":26,\"fileId\":159,\"mark\":\"作家:雨果\",\"modelId\":14,\"params\":{},\"url\":\"/profile/avatar/2022/02/21/9015b25f-ab24-4470-a964-2109c3f000c0.png\"}]}',0,NULL,'2022-02-21 15:49:43'),
