(1536,'作信息者',1,'com.nhXJH.web.controller.appllication.LibraryAuthController.add()','POST',1,'admin',NULL,'/userApplication/auth','127.0.0.1','内网IP','{\"country\":\"中国\",\"englishName\":\"Cixin Liu\",\"auth\":{\"country\":\"中国\",\"englishName\":\"Cixin Liu\",\"nickName\":\"刘电工、大刘\",\"sex\":1,\"synopsis\":\"刘慈欣，1963年6月出生于北京，祖籍河南省信阳市罗山，山西阳泉人，本科学历。1985年10月参加工作，作品蝉联1999年—2006年中国科幻小说银河奖，2010年赵树理文学奖，2011年《当代》年度长篇小说五佳第三名，2011年华语科幻星云奖最佳长篇小说奖，2010、2011年华语科幻星云奖最佳科幻作家奖，2012年人民文学柔石奖短篇小说金奖，2013年首届西湖类型文学奖金奖、第九届全国优秀儿童文学奖。代表作有长篇小说《超新星纪元》《球状闪电》《三体》三部曲等，中短篇小说《流浪地球》《乡村教师》《朝闻道》《不能共存的节日》《全频带阻塞干扰》等。其中《三体》三部曲被普遍认为是中国科幻文学的里程碑之作。2015年8月23日，凭借《三体》获第73届世界科幻大会颁发的雨果奖最佳长篇小说奖，为亚洲首次获奖。2017年6月25日，凭借《三体3：死神永生》获得轨迹奖最佳长篇科幻小说奖。2018年11月8日，获2018年克拉克想象力服务社会奖。2019年2月5日，刘慈欣作品改编电影《流浪地球》和《疯狂的外星人》上映，8月，获2019福布斯中国100名人榜荣誉。\",\"params\":{},\"createTime\":1645430180990,\"identity\":\"高级工程师,科幻作家,中国作家协会会员,第九届、第十届全委会委员,中国科普作家协会会员,山西省作家协会副主席,阳泉市作家协会副主席,中国科幻小说代表作家\",\"name\":\"刘慈欣\",\"createPersonal\":1,\"status\":\"1\"},\"nickName\":\"刘电工、大刘\",\"sex\":1,\"synopsis\":\"刘慈欣，1963年6月出生于北京，祖籍河南省信阳市罗山，山西阳泉人，本科学历。1985年10月参加工作，作品蝉联1999年—2006年中国科幻小说银河奖，2010年赵树理文学奖，2011年《当代》年度长篇小说五佳第三名，2011年华语科幻星云奖最佳长篇小说奖，2010、2011年华语科幻星云奖最佳科幻作家奖，2012年人民文学柔石奖短篇小说金奖，2013年首届西湖类型文学奖金奖、第九届全国优秀儿童文学奖。代表作有长篇小说《超新星纪元》《球状闪电》《三体》三部曲等，中短篇小说《流浪地球》《乡村教师》《朝闻道》《不能共存的节日》《全频带阻塞干扰》等。其中《三体》三部曲被普遍认为是中国科幻文学的里程碑之作。2015年8月23日，凭借《三体》获第73届世界科幻大会颁发的雨果奖最佳长篇小说奖，为亚洲首次获奖。2017年6月25日，凭借《三体3：死神永生》获得轨迹奖最佳长篇科幻小说奖。2018年11月8日，获2018年克拉克想象力服务社会奖。2019年2月5日，刘慈欣作品改编电影《流浪地球》和《疯狂的外星人》上映，8月，获2019福布斯中国100名人榜荣誉。\",\"params\":{},\"createTime\":1645430180990,\"identity\":\"高级工程师,科幻作家,中国作家协会会员,第九届、第十届全委会委员,中国科普作家协会会员,山西省作家协会副主席,阳泉市作家协会副主席,中国科幻小说代表作家\",\"picList\":[{\"createPerson\":1,\"url\":\"/profile/avatar/2022/02/21/f7bc6aa1-9da4-43a6-87eb-d6939c6449cc.png\",\"groudId\":-8670638077884097000,\"newName\":\"2022/02/21/23567b9e-148f-4f43-b53d-15b9102f110e.png\",\"createTime\":1645430178956,\"name\":\"作家-刘慈欣.png\",\"id\":160,\"status\":0}],\"name\":\"刘慈欣\",\"createPersonal\":1,\"status\":\"1\"}