(1901,'作信息者',2,'com.nhXJH.web.controller.appllication.LibraryAuthController.edit()','PUT',1,'admin',NULL,'/userApplication/auth','127.0.0.1','内网IP','{\"country\":\"日本\",\"englishName\":\"Ultraman\",\"auth\":{\"country\":\"日本\",\"englishName\":\"Ultraman\",\"nickName\":\"奥特曼\",\"sex\":0,\"updateTime\":1645876426848,\"synopsis\":\"  奥特曼系列（日语：ウルトラマンシリーズ），是日本“特摄之神”的圆谷英二导演一手创办的“圆谷制作公司”（円谷プロダクション，原名：圆谷株式会社）自二十世纪六十年代起推出的空想特摄系列电视剧、电影、漫画、舞台剧等作品。\\n  以1966年的《奥特Q》为首，自同年刚播出的《奥特曼》开始，建立了“巨大英雄与怪兽对战”的模式。中国台湾早期则有《飞天超空人》《大超人》《银河飞超人》《超人战士》等译名，后来受中国香港的影响也曾经一度用过《咸蛋超人》的译名。\",\"params\":{},\"updatePersonal\":1,\"createTime\":1644997527000,\"identity\":\"宇宙保卫者,宇宙警备队大队长宇宙英雄,超人力霸王战士,咸蛋超人\",\"name\":\"赛文·奥特曼\",\"createPersonal\":1,\"id\":6,\"status\":\"1\"},\"nickName\":\"奥特曼\",\"sex\":0,\"updateTime\":1645876426848,\"synopsis\":\"  奥特曼系列（日语：ウルトラマンシリーズ），是日本“特摄之神”的圆谷英二导演一手创办的“圆谷制作公司”（円谷プロダクション，原名：圆谷株式会社）自二十世纪六十年代起推出的空想特摄系列电视剧、电影、漫画、舞台剧等作品。\\n  以1966年的《奥特Q》为首，自同年刚播出的《奥特曼》开始，建立了“巨大英雄与怪兽对战”的模式。中国台湾早期则有《飞天超空人》《大超人》《银河飞超人》《超人战士》等译名，后来受中国香港的影响也曾经一度用过《咸蛋超人》的译名。\",\"params\":{},\"updatePersonal\":1,\"createTime\":1644997527000,\"identity\":\"宇宙保卫者,宇宙警备队大队长宇宙英雄,超人力霸王战士,咸蛋超人\",\"picList\":[],\"name\":\"赛文·奥特曼\",\"createPersonal\":1,\"id\":6,\"status\":\"1\"}','{\"msg\":\"操作成功\",\"code\":200,\"data\":[]}',0,NULL,'2022-02-26 19:53:47'),
